690498", "organization": {"description": "", "title": "Statistics Canada | Statistique Canada", "created": "2013-05-14T09:17:52.316230", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.272382", "is_organization": true, "state": "active", "image_url": "", "revision_id": "87fcd1c4-2bd0-4977-ab91-3622e73393e2", "type": "organization", "id": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "name": "statcan"}, "metadata_modified": "2013-06-03T01:11:32.690498", "isopen": false, "url": "http://www12.statcan.gc.ca/census-recensement/2011/geo/index-eng.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Economic Region Digital Boundary Files - 2006 Census ", "revision_id": "3fc5de1f-015b-41f3-a08a-51cefe8b3d20", "notes": "The boundary files portray the geographic limits used for census dissemination. They are available for download in two types: cartographic and digital. Cartographic boundary files depict the geographic areas using only the shorelines of the major land mass of Canada and its coastal islands. Digital boundary files depict the full extent of the geographic areas, including the coastal water area. The files provide a framework for mapping and spatial analysis using commercially available geographic information systems (GIS) or other mapping software.\r\n", "department_number": 256}
