{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Le Fichier canadien sur les \u00e9l\u00e9ments nutritifs -  Interface de recherche interactive", "keywords": "CNF, Canadian Nutrient File, food, nutrient profile, nutritional profile, nutrition", "data_series_issue_identification": "", "id": "9529119f-f60a-46c1-aaac-f8a5d6745e14", "metadata_created": "2013-05-23T16:49:54.951707", "subject": ["Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Le Fichier canadien sur les \u00e9l\u00e9ments nutritifs (FC\u00c9N) est la base de donn\u00e9es de r\u00e9f\u00e9rence sur la composition des aliments qui nous informe de la quantit\u00e9 des \u00e9l\u00e9ments nutritifs dans les aliments couramment consomm\u00e9s au Canada. Il s\u2019agit d\u2019une base de donn\u00e9es \u00e9lectronique qui contient des donn\u00e9es sur plus de 6000 aliments et 150 constituants alimentaires. Parmi les utilisateurs gouvernementaux, nous retrouvons Agriculture et Agroalimentaire Canada (AAC), Statistiques Canada ainsi que l'Agence canadienne d'inspection des aliments (ACIA). De plus, le FC\u00c9N est utilis\u00e9 par tout un spectre d'usagers externes incluant les milieux hospitaliers, les universit\u00e9s, l'industrie alimentaire et le grand public. Ce site met en valeur un moteur de recherche qui permet aux usagers d\u2019effectuer des recherches d\u2019aliments et de visionner la teneur en \u00e9l\u00e9ments nutritifs de ces aliments.  Des rapports d\u2019aliments peuvent \u00eatre export\u00e9s ainsi que des listes d\u2019aliments qui contiennent un \u00e9l\u00e9ment nutritif pr\u00e9cis peuvent \u00eatre imprim\u00e9s ou export\u00e9s.  \r\n", "digital_object_identifier": "", "state": "draft-complete", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "9b96d580-d24a-42fd-8458-cdb6ce175932", "cache_last_updated": null, "revision_timestamp": "2013-05-23T18:03:45.565711", "webstore_last_updated": null, "id": "5ed04fe7-dad2-4eac-b807-bb921b55c201", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "The Canadian Nutrient File \u2013 Data Download  ", "mimetype": null, "cache_url": null, "name_fra": "Le Fichier canadien sur les \u00e9l\u00e9ments nutritifs -  T\u00e9l\u00e9chargement des donn\u00e9es", "language": "eng; CAN | fra; CAN", "created": "2013-05-23T14:03:45.701015", "url": "http://www.hc-sc.gc.ca/fn-an/nutrition/fiche-nutri-data/index-eng.php      http://www.hc-sc.gc.ca/fn-an/nutrition/fiche-nutri-data/index-fra.php", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "35feb1e6-d9a6-41f1-ac92-bd0a68a3bc3a", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Health  Sant\u00e9"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Health  Sant\u00e9", "name": "Health  Sant\u00e9", "revision_timestamp": "2013-05-23T16:49:54.951707", "state": "active", "id": "69b6266b-213d-4e48-b1a7-53dfa04c3aa1"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "revision_timestamp": "2013-05-23T16:49:54.951707", "state": "active", "id": "d6525956-d45a-41d8-bdeb-1a6c4a0c9a5f"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-05-23 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "FC\u00c9N, Fichier canadien sur les \u00e9l\u00e9ments nutritifs, aliment, profil des \u00e9l\u00e9ments nutritifs, profil des nutriments, profil nutritionnel, nutrition", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "9529119f-f60a-46c1-aaac-f8a5d6745e14", "revision_timestamp": "2013-05-23T18:04:37.509674", "organization": {"description": "", "title": "Health Canada | Sant\u00e9 Canada", "created": "2013-05-14T09:17:51.376994", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:51.333174", "is_organization": true, "state": "active", "image_url": "", "revision_id": "94e225c6-b021-43c0-a7df-9beb7a7c1dae", "type": "organization", "id": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "name": "hc-sc"}, "metadata_modified": "2013-05-23T18:04:37.509674", "isopen": false, "url": "", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "url_fra": "", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "The Canadian Nutrient File \u2013 Interactive Search Interface ", "revision_id": "055360e7-ba86-4d93-8da5-84c6048c22ed", "notes": "The Canadian Nutrient File (CNF) is the standard reference food composition database reporting the amount of nutrients in foods commonly consumed in Canada. It is an electronic database reporting up to 150 nutrients in over 6000 foods commonly consumed by Canadians.  The CNF is utilized by a number of government departments as well as a large spectrum of external users, including hospitals, universities, food manufacturers and the general public.  This site features an application that easily allows users to search for foods of interest and view the nutrient contents of those foods.  Reports for individual foods can be exported or lists of foods containing a particular nutrient can also be printed or exported.   ", "department_number": 271}
