{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Qualit\u00e9 de l'eau de surface", "keywords": "water quality, long term monitoring, oil sands", "data_series_issue_identification": "", "ready_to_publish": true, "id": "ec43763c-6dbc-4b90-966e-4ba703ca8ced", "metadata_created": "2013-06-13T19:16:29.406612", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Dans le cadre du Plan conjoint de mise en \u0153uvre Canada-Alberta, le programme de surveillance de la qualit\u00e9 des eaux de surface est con\u00e7u pour am\u00e9liorer la capacit\u00e9 \u00e0 d\u00e9tecter les changements et \u00e0 pr\u00e9voir les effets de la pollution des sources ponctuelles et diffuses. Une approche fond\u00e9e sur le bilan massique a \u00e9t\u00e9 utilis\u00e9e pour \u00e9valuer la quantit\u00e9, les d\u00e9placements et le cycle des mati\u00e8res dans le bassin versant. L'application de cette approche exigeait un programme d'\u00e9chantillonnage incluant la quantification des sources, le transport, le flux et le devenir des mati\u00e8res et des contaminants. L'\u00e9chantillonnage dans le cadre du programme de surveillance de la qualit\u00e9 des eaux de surface comprend, en partie, les \u00e9l\u00e9ments suivants :\r\n- des \u00e9chantillons pr\u00e9lev\u00e9s dans les affluents pour surveiller la qualit\u00e9 de l'eau selon les \u00e9v\u00e9nements (crue nivale et pluie), sur une base quotidienne ou bimensuelle;\r\n- des \u00e9chantillons pr\u00e9lev\u00e9s dans la rivi\u00e8re Athabasca pour surveiller la qualit\u00e9 de l'eau dans des sites pr\u00e9cis de la premi\u00e8re phase \u00e0 l'aide des m\u00e9thodes des transects \u00e0 travers un chenal;\r\n- des \u00e9chantillons am\u00e9lior\u00e9s (param\u00e8tres suppl\u00e9mentaires) pr\u00e9lev\u00e9s pour surveiller la qualit\u00e9 de l'eau aux stations M9, M12 et M11A, ainsi qu'\u00e0 cinq nouvelles stations des voies de passage dans la zone g\u00e9ographique \u00e9largie;\r\n- des \u00e9chantillons d'eau souterraine pr\u00e9lev\u00e9s dans certains affluents hautement prioritaires;\r\n- une autosurveillance (en temps quasi r\u00e9el) d'un sous-ensemble de param\u00e8tres dans des sites de la zone g\u00e9ographique \u00e9largie.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-111.90408,59.01663], [-110.62967,59.01663], [-110.62967,56.66556], [-111.90408,56.66556],[-111.90408,59.01663]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=fr", "type": "dataset", "resources": [{"resource_group_id": "28f0c747-a8a9-4e87-bf32-6c5b5840c2d4", "cache_last_updated": null, "revision_timestamp": "2013-06-13T19:17:31.905839", "webstore_last_updated": "2013-06-16T18:15:03.039661", "id": "036728ee-24fe-4107-a2b3-3f6c2809078c", "size": null, "state": "active", "hash": "", "description": "", "format": "XLS", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "OSM Water Quality Data", "mimetype": null, "cache_url": null, "name_fra": "OSM Water Quality Data", "language": "eng; CAN | fra; CAN", "created": "2013-06-13T15:17:32.028240", "url": "http://www.ec.gc.ca/data_donnees/SSB-QualEau_OSM-WaterQual/Surface_Water_Quality/", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "a52303ff-199a-4bf8-bb16-e883348d9611", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-13T19:16:29.406612", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T19:16:29.406612", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-12-18 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "qualit\u00e9 de eau, surveillance \u00e0 long terme, sables bitumineux", "groups": [], "time_period_coverage_start": "1989-04-01 00:00:00", "data_series_name": "", "relationships_as_subject": [], "name": "ec43763c-6dbc-4b90-966e-4ba703ca8ced", "revision_timestamp": "2013-06-13T19:18:08.592608", "organization": {"description": "", "title": "Environment Canada | Environnement Canada", "created": "2013-05-14T09:17:41.395797", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.354936", "is_organization": true, "state": "active", "image_url": "", "revision_id": "18112ac5-2ef2-4519-ad05-a58dc9985d41", "type": "organization", "id": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "name": "ec"}, "metadata_modified": "2013-06-14T16:39:35.298927", "isopen": false, "date_modified": "2012-12-18 00:00:00", "url": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=en", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Surface Water Quality", "revision_id": "14a1079e-df16-493b-9885-bc16f389703d", "notes": "The surface water quality (WQ) program, as part of the Joint Canada/Alberta Implementation Plan, is designed to improve the ability to detect change and predict effects in relation to point and non\u2010point sources. A mass\u2010balance approach has been used for assessing the quantity, movement, and cycling of materials in the watershed. Applying this approach required a sampling program which included quantification of the sources, transport, flux, and fate of materials and contaminants. The Surface WQ monitoring sampling includes, in part, collection of;\r\n-\tevent (freshet and rain) based WQ samples in tributaries ranging from daily to bi-weekly,\r\n-\tWQ samples in the Athabasca River using cross-channel transect methods at specified Phase 1 sites, \r\n-\tenhanced (additional parameters) WQ  sampling at M9, M12, and M11A and at 5 new interconnecting channel stations within the Expanded Geographical Area (EGA),\r\n-\tground water samples in specific high priority tributaries, and\r\n-\tauto-monitoring (near real-time) on a subset of parameters at sites in the EGA", "department_number": 99}
