{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Sant\u00e9 des invert\u00e9br\u00e9s et des \u00e9cosyst\u00e8mes", "keywords": "biomonitoring, oil sands, benthic invertebrates, water quality, rivers, streams, wetlands, geospatial information", "data_series_issue_identification": "", "ready_to_publish": true, "id": "6e476fe0-28a3-4b8f-bb79-a2fded66a68b", "metadata_created": "2013-06-13T19:10:58.166885", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Le programme de surveillance de la sant\u00e9 des invert\u00e9br\u00e9s et de l'\u00e9cosyst\u00e8me porte \u00e0 la fois sur les \u00e9cosyst\u00e8mes lotiques (rivi\u00e8res ou ruisseaux) et les \u00e9cosyst\u00e8mes lentiques (terres humides). La biosurveillance aquatique offre une mesure directe des changements touchant les populations et les communaut\u00e9s biotiques selon le point de r\u00e9f\u00e9rence ou les conditions de r\u00e9f\u00e9rence et aide \u00e0 d\u00e9terminer les r\u00e9percussions \u00e9cologiques de facteurs de stress cumulatifs. Utilis\u00e9 conjointement aux composantes de surveillance des param\u00e8tres physiques et chimiques de l'eau, ce programme utilise une approche int\u00e9gr\u00e9e afin de d\u00e9terminer si les r\u00e9percussions \u00e9cologiques sont dues \u00e0 l'exploitation des sables bitumineux.\r\n\r\nL'\u00e9chantillonnage peut inclure la collecte d'invert\u00e9br\u00e9s, la biomasse des algues, la composition chimique de l'eau et des renseignements \u00e0 l'appui pertinents concernant l'habitat. Il est, en outre, men\u00e9 au cours de p\u00e9riodes de forte abondance et de diversit\u00e9 des macro-invert\u00e9br\u00e9s. L'\u00e9chantillonnage porte principalement sur les habitats de gravier et de sable pr\u00e8s des rives de la rivi\u00e8re Athabasca, ainsi que sur les habitats d'\u00e9rosion dans les principaux affluents et dans les zones accessibles \u00e0 gu\u00e9 dans les terres humides delta\u00efques, au sein de la zone g\u00e9ographique \u00e9largie. Au mois d'octobre 2012, plus de 80 sites avaient d\u00e9j\u00e0 \u00e9t\u00e9 visit\u00e9s.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Table Digital | Table num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-111.90408,59.01663], [-110.62967,59.01663], [-110.62967,56.66556], [-111.90408,56.66556],[-111.90408,59.01663]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=fr", "type": "dataset", "resources": [{"resource_group_id": "eaee7894-c824-4c70-8604-d28b0a58485d", "cache_last_updated": null, "revision_timestamp": "2013-06-13T19:11:49.110038", "webstore_last_updated": null, "id": "e2b5f0a0-f5f3-4fd3-9ba3-d98172938552", "size": null, "state": "active", "hash": "", "description": "", "format": "XLS", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "OSM Water Quality Data", "mimetype": null, "cache_url": null, "name_fra": "OSM Water Quality Data", "language": "eng; CAN | fra; CAN", "created": "2013-06-13T15:11:49.211432", "url": "http://www.ec.gc.ca/data_donnees/SSB-QualEau_OSM-WaterQual/Invertebrates_and_Ecosystem_Health/", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "3ccc89e6-7adb-485b-a0bb-230dc5c13fb6", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-13T19:10:58.166885", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T19:10:58.166885", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-12-18 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "biosurveillance, sables bitumineux, benthic invertebrates, qualit\u00e9 de eau, rivi\u00e8res, ruisseaux, terres humides, information g\u00e9ospatiale", "groups": [], "time_period_coverage_start": "2011-08-01 00:00:00", "data_series_name": "", "relationships_as_subject": [], "name": "6e476fe0-28a3-4b8f-bb79-a2fded66a68b", "revision_timestamp": "2013-06-13T19:12:21.317747", "organization": {"description": "", "title": "Environment Canada | Environnement Canada", "created": "2013-05-14T09:17:41.395797", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.354936", "is_organization": true, "state": "active", "image_url": "", "revision_id": "18112ac5-2ef2-4519-ad05-a58dc9985d41", "type": "organization", "id": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "name": "ec"}, "metadata_modified": "2013-06-13T19:12:21.317747", "isopen": false, "date_modified": "2012-12-18 00:00:00", "url": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=en", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Invertebrates and Ecosystem Health", "revision_id": "63182baf-b281-4c6b-be6e-8171a37ffdf8", "notes": "The Invertebrate and Ecosystem Health monitoring program includes both lotic (rivers/streams) and lentic (wetlands) ecosystems. Aquatic biomonitoring provides a direct measure of change in biotic populations and communities in relation to benchmark or reference conditions and can help identify the ecological effects of cumulative stressors. Used together with the water chemical and physical monitoring components, this program uses an integrated approach to assess whether ecological affects are occurring in response to OS developments.\r\n\r\nSampling can include the collection of invertebrates, algal biomass, water chemistry, and appropriate supporting habitat information and is conducted during periods of high abundance and diversity of macroinvertebrates. Sampling focuses on near-shore gravel and sand habitats on the Athabasca River, erosional habitats on major tributaries and in wadable areas in deltaic wetlands within the Expanded Geographical Area. As of October 2012, over 80 locations have been visited.", "department_number": 99}
