{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 12, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Ruissellement unitaire annuel au Canada selon AAC - 2013", "keywords": "hydrology, water management, water supply, watersheds, water resource management", "data_series_issue_identification": "", "ready_to_publish": true, "id": "5260064f-9c38-4ef4-ad45-478f1a272f64", "metadata_created": "2013-06-05T21:07:08.183797", "subject": ["Nature and Environment  Nature et environnement", "Agriculture  Agriculture"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Quebec  Qu\u00e9bec", "Ontario  Ontario", "Territories  Territoires", "Atlantic  Atlantique", "Prairies  Prairies", "British Columbia  Colombie-Britannique"], "notes_fra": "La s\u00e9rie d\u2019ensembles de donn\u00e9es \u00ab Ruissellement unitaire annuel au Canada selon AAC \u2013 2013 \u00bb pr\u00e9sente les tendances du ruissellement dans l\u2019ensemble du pays au moyen d\u2019isolignes du ruissellement unitaire annuel pour diverses probabilit\u00e9s de d\u00e9passement commun\u00e9ment utilis\u00e9es par les d\u00e9cideurs. Le ruissellement unitaire annuel est une mesure du volume d\u2019eau de ruissellement par kilom\u00e8tre carr\u00e9. L\u2019unit\u00e9 utilis\u00e9e dans cette s\u00e9rie d\u2019ensembles de donn\u00e9es est le d\u00e9cam\u00e8tre cube (1000 m3) par kilom\u00e8tre carr\u00e9 (dam3/km2), qui \u00e9quivaut \u00e0 une hauteur de pr\u00e9cipitation de un millim\u00e8tre sur le paysage. La s\u00e9rie comprend un ensemble de donn\u00e9es ponctuelles concernant les stations hydrom\u00e9triques utilis\u00e9es pour l\u2019analyse du ruissellement unitaire, et sept ensembles de donn\u00e9es pr\u00e9sentant les isolignes ajust\u00e9es pour les probabilit\u00e9s de d\u00e9passement de 10 %, 25 %, 50 %, 70 %, 75 %, 80 % et 90 %.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "9617cbfd-1162-4966-93a6-f64e7905c0f7", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:38:25.580629", "webstore_last_updated": null, "id": "9c4efd9a-0377-4196-b81f-ba279fb3bbb4", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-05T17:08:29.246490", "url": "http://www.agr.gc.ca/atlas/data_donnees/env/aafcAnnualUnitRunoff2013/en/aafc_annual_unit_runoff_2013.zip ", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "a8332e8d-d116-41b4-9a82-7e041584b840", "resource_type": "file"}, {"resource_group_id": "9617cbfd-1162-4966-93a6-f64e7905c0f7", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:39:02.834918", "webstore_last_updated": null, "id": "4bfdec4e-beb0-45eb-9adf-8075c2407843", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-05T17:09:35.090887", "url": "http://www.agr.gc.ca/atlas/data_donnees/env/aafcAnnualUnitRunoff2013/fr/aacRuissellementUn