: "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "5260064f-9c38-4ef4-ad45-478f1a272f64", "revision_timestamp": "2013-06-06T13:58:32.481042", "metadata_modified": "2013-06-12T19:39:02.834918", "isopen": false, "date_modified": "2013-03-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "AAFC Annual Unit Runoff in Canada - 2013", "revision_id": "f806ab31-6dad-4914-a79c-f75406fec562", "notes": "The \u201cAAFC Annual Unit Runoff in Canada - 2013\u201d data series illustrates runoff trends across the country by isolines of annual unit runoff for a variety of probabilities of exceedence commonly used by decision makers Annual unit runoff is a measure of runoff volume per square kilometre.  This series uses units of cubic decametres (1000 m3) per square kilometre (dam3/km2), which is equivalent to millimetres depth on the landscape. It includes a point data set for the hydrologic stations that were analyzed and seven sets of line work to show the adjusted isolines for 10%, 25%, 50%, 70%, 75%, 80%, and 90% probability of exceedence. \r\n", "department_number": 235}
