2fd-9d8f1dc868b1", "time_period_coverage_end": "2011-01-01 00:00:00", "num_tags": 2, "organization": {"description": "", "title": "Statistics Canada | Statistique Canada", "created": "2013-05-14T09:17:52.316230", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.272382", "is_organization": true, "state": "active", "image_url": "", "revision_id": "87fcd1c4-2bd0-4977-ab91-3622e73393e2", "type": "organization", "id": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "name": "statcan"}, "metadata_modified": "2013-06-01T18:06:24.481310", "isopen": false, "url": "http://www12.statcan.gc.ca/census-recensement/2011/geo/index-eng.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Census Consolidated Subdivision Digital Boundary Files - 2011 Census", "revision_id": "19447cc2-a391-4048-90bf-a2bc8869aa69", "notes": "The boundary files portray the geographic limits used for census dissemination. They are available for download in two types: cartographic and digital. Cartographic boundary files depict the geographic areas using only the shorelines of the major land mass of Canada and its coastal islands. Digital boundary files depict the full extent of the geographic areas, including the coastal water area. The files provide a framework for mapping and spatial analysis using commercially available geographic information systems (GIS) or other mapping software.", "department_number": 256}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 9, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Donn\u00e9es climatologiques issues de la surveillance de la s\u00e9cheresse", "keywords": "Farmlands, Crop, Agriculture, Temperature, Precipitation", "data_series_issue_identification": "", "ready_to_publish": true, "id": "14bc134b-6b1d-403a-859a-ebcc853d3ccf", "metadata_created": "2013-06-13T20:53:38.522903", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario  Ontario", "Territories  Territoires", "Prairies  Prairies", "Quebec  Qu\u00e9bec", "British Columbia  Colombie-Britannique", "Atlantic  Atlantique"], "notes_fra": "L'impact des changements climatiques sur l'environnement est d'une importance primordiale pour le secteur agricole au Canada. La surveillance des r\u00e9percussions sur l'approvisionnement en eau, la d\u00e9gradation des sols et la production agricole est essentielle pour qu'une r\u00e9gion soit pr\u00eate \u00e0 faire face \u00e0 de possibles s\u00e9cheresses. \r\nLes donn\u00e9es climatiques d\u00e9riv\u00e9es pour la surveillance de la s\u00e9cheresse propose une s\u00e9rie de donn\u00e9es th\u00e9matiques sur l'agroclimat indiquant les normales, \u00e0 long terme, de pr\u00e9cipitation, de temp\u00e9rature, du nombre de degr\u00e9s-jours de croissance et bien plus encore. Ces tendances \u00e0 long terme sont essentielles pour comprendre les risques et les r\u00e9percussions possibles associ\u00e9s \u00e0 la s\u00e9cheresse au Canada. Les normales climatiques d\u00e9signent les conditions climatiques moyennes \u00e0 long terme observ\u00e9es \u00e0 un endroit en particulier.\r\nCes moyennes \u00e0 long terme, qui peuvent servir de base de r\u00e9f\u00e9rence permettant de comparer les conditions actuelles, se r\u00e9v\u00e8lent particuli\u00e8rement utiles pour surveiller les risques de s\u00e9cheresse. \r\nAfin de produire une couverture compl\u00e8te \u00e0 partir des donn\u00e9es d\u2019observation ponctuelles recueillies par Environnement Canada \u00e0 des stations m\u00e9t\u00e9orologiques partout au pays, les donn\u00e9es sont interpol\u00e9es dans une s\u00e9rie de donn\u00e9es climatiques maill\u00e9es; cette s\u00e9rie de donn\u00e9es est constitu\u00e9e d\u2019estimations ponctuelles interpol\u00e9es dispos\u00e9es sur une grille r\u00e9guli\u00e8re \u00e0 mailles d\u2019environ 10 km. Chacun des donn\u00e9es s\u2019appuient sur des donn\u00e9es recueillies pendant 30 ans, soit de 1971 \u00e0 2000. Th\u00e8mes des jeux de donn\u00e9es comprennent les temp\u00e9ratures et pr\u00e9cipitations moyennes \u00e0 long terme. Les valeurs des ensembles de donn\u00e9es sont additionn\u00e9es et ont \u00e9t\u00e9 s\u00e9par\u00e9s pendant un mois donn\u00e9 (Janvier-D\u00e9cembre) ainsi que des unit\u00e9s thermiques de croissance et des degr\u00e9s-jours de croissance. \r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "5861d0ab-aeb3-4b38-be5b-a0fc4c8ebb71", "cache_last_updated": null, "revision_timestamp": "2013-06-13T20:58:21.632055", "webstore_last_updated": null, "id": "7d1527db-561b-4765-b487-4b674ebee92c", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-13T16:58:21.805952", "url": "http://www.agr.gc.ca/atlas/data_donnees/cli/aafcDwimDerivedClimateData/en/aafcDwimDerivedClimateData.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "12f5cc76-1017-42d0-80e7-0c45eb513dbf", "resource_type": "file"}, {"resource_group_id": "5861d0ab-aeb3-4b38-be5b-a0fc4c8ebb71", "cache_last_updated": null, "revision_timestamp": "2013-06-13T20:59:10.734966", "webstore_last_updated": null, "id": "a05c75b2-689c-48e2-b8cc-b31072384100", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-13T16:59:10.869039", "url": "http://www.agr.gc.ca/atlas/data_donnees/cli/aafcDwimDerivedClimateData/fr/aacDonneesClimatologiquesIssuesDeLaCiss.zip", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "de28fc3f-3973-47d8-aa8b-dfe13c637d63", "resource_type": "file"}, {"resource_group_id": "5861d0ab-aeb3-4b38-be5b-a0fc4c8ebb71", "cache_last_updated": null, "revision_timestamp": "2013-06-13T20:59:49.471142", "webstore_last_updated": null, "id": "02998354-6ea0-41ee-9edc-ff743ff48671", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Supporting Document", "mimetype": null, "cache_url": null, "name_fra": "Document connexe", "language": "eng; CAN", "created": "2013-06-13T16:59:49.646234", "url": "http://www.agr.gc.ca/atlas/supportdocument_documentdesupport/aafcDwimDerivedClimateData/en/", "webstore_url": null, "last_modified": null, "position": 2, "revision_id"