{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Climatology Meteorology Atmosphere  Climatologie M\u00e9t\u00e9orologie Atmosph\u00e8re", "name": "Climatology Meteorology Atmosphere  Climatologie M\u00e9t\u00e9orologie Atmosph\u00e8re", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "da0bff9c-a8ba-4128-8350-77f1266162fd"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Ontario  Ontario", "name": "Ontario  Ontario", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "170ff7c8-314d-4801-853c-97c87b308aa9"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Quebec  Qu\u00e9bec", "name": "Quebec  Qu\u00e9bec", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "db38a71d-cc91-40b2-b3de-a893f2fc46be"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Territories  Territoires", "name": "Territories  Territoires", "revision_timestamp": "2013-06-13T20:53:38.522903", "state": "active", "id": "c6c59b71-ac42-4d28-a607-4a87aba661c7"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-13 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "terres agricoles, culture, agriculture, temp\u00e9rature, pr\u00e9cipitations", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "14bc134b-6b1d-403a-859a-ebcc853d3ccf", "revision_timestamp": "2013-06-13T21:01:01.992239", "metadata_modified": "2013-06-13T21:01:01.992239", "isopen": false, "date_modified": "2010-02-21 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Drought Watch Derived Climate Data", "revision_id": "73999339-9ca4-4bc9-876e-593ee3d0732b", "notes": "The impact of climatic variability on the environment is of great importance to the agricultural sector in Canada. Monitoring the impacts on water supplies, soil degradation and agricultural production is essential to the preparedness of the region in dealing with possible drought conditions.\r\nThe Drought Watch Derived Climate data presents a series of agroclimate thematic datasets depicting long-term \u201cnormals\u201d for precipitation, temperature, growing degree days, and more. These long-term trends are key to understanding the risk and potential impacts of drought in Canada. Climate normals represent long-term averages of climate conditions observed at a particular location. \r\nThese long-term averages can be used as a baseline to compare against current conditions, and are particularly useful for monitoring drought risk.\r\nIn order to provide a complete coverage from the point-based observation data collected by Environment Canada at weather stations across the country, the data are interpolated into a gridded climate dataset, made up of interpolated point estimates arranged in a regular grid with a spacing of approximately 10 km. Each dataset is based on data collected over 30 years, from 1971 to 2000.  Dataset themes include Long-Term Average Temperature and Precipitation datasets are summed values and have been separated out for a given month (January\u2013December) as well as Crop Heat Units and Growing Degree Days.\r\n", "department_number": 235}
