{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Les avis de conformit\u00e9 principaux", "keywords": "notice of compliance listings, notices of compliance with conditions", "data_series_issue_identification": "", "id": "e36f617d-f8b1-48a3-a42d-b6378aa4c683", "metadata_created": "2013-05-14T13:56:37.906411", "subject": ["Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Unknown | Inconnu", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Un avis de conformit\u00e9 (AC) est une notification d\u00e9livr\u00e9e en vertu du paragraphe C.08.004(1)(a), indiquant que le fabricant/promoteur se conforme aux articles C.08.002 ou C.08.003 et C.08.005.1 du R\u00e8glement sur les aliments et drogues. Un avis de conformit\u00e9 est \u00e9mis si la pr\u00e9sentation est jug\u00e9e conforme apr\u00e8s un examen complet.\r\nLes fichiers contenus dans l'extrait des donn\u00e9es d'avis de conformit\u00e9 contiennent les dates d'autorisation pour tous les m\u00e9dicaments pour lesquels un AC a \u00e9t\u00e9 \u00e9mis depuis 1994. Il y a quatre types d'AC : biologique, vente libre, vente sous ordonnance et v\u00e9t\u00e9rinaire. Ce fichier de donn\u00e9es contient des renseignements sur les avis de conformit\u00e9 principaux.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "d899d31d-caec-4db3-b177-cede9ec75370", "cache_last_updated": null, "revision_timestamp": "2013-05-1