{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 13, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Donn\u00e9es de gestion de l\u2019OCIB", "keywords": "biomass, bioenergy, forestry, agriculture, environment, transport, harvest", "data_series_issue_identification": "", "ready_to_publish": true, "id": "aa72a5d5-380e-4e38-8740-42c3ad840fca", "metadata_created": "2013-06-03T19:12:35.202564", "subject": ["Economics and Industry  \u00c9conomie et industrie", "Information and Communications  Information et communication", "Agriculture  Agriculture", "Nature and Environment  Nature et environnement", "Transport  Transport"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario  Ontario", "Prairies  Prairies", "Quebec  Qu\u00e9bec", "Atlantic  Atlantique", "British Columbia  Colombie-Britannique"], "notes_fra": "Les \u00ab Donn\u00e9es de gestion de l\u2019Outil cartographique d\u2019inventaire de la biomasse \u00bb fournissent un certain nombre de jeux de donn\u00e9es li\u00e9s au rendement et \u00e0 la production de r\u00e9sidus des industries agricole et foresti\u00e8re et des cultures.\r\n\r\nLes jeux de donn\u00e9es contiennent des renseignements sur la production de r\u00e9sidus agricoles (par exemple, la paille ou le fourrage) pour l\u2019orge, le bl\u00e9, le lin, l\u2019avoine et le ma\u00efs, et des donn\u00e9es sur la production des cultures pour l\u2019orge, le bl\u00e9, le lin, l\u2019avoine, le ma\u00efs, le canola et le soja. Ils contiennent aussi de l\u2019information sur les quantit\u00e9s de paille requises pour la nourriture et la liti\u00e8re du 