 Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "aa72a5d5-380e-4e38-8740-42c3ad840fca", "revision_timestamp": "2013-06-06T14:23:43.605909", "metadata_modified": "2013-06-12T19:22:29.081217", "isopen": false, "date_modified": "2013-04-30 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "BIMAT \u2013 Business Data", "revision_id": "fe9d8caa-9687-4eeb-af6c-0287daa4b104", "notes": "\u201cBiomass Inventory Mapping and Analysis Tool \u2013 Business Data\u201d provides a number of datasets related to the yield and production of residues from the agricultural and forestry industry and agricultural crops.\r\n\r\nThe datasets contain agricultural residue production information (for example, straw or stover) for barley, wheat, flax, oats and corn, and crop production information for barley, wheat, flax, oats, corn, canola and soybean. They also include information about amounts of straw required for cattle bedding and feeding, the type of tillage used in an area, and the amount of residue needed for soil conservation purposes.\r\nDatasets in the series provide the yield, production and other information for the median year and 1-in-10 year and 1-in-20 year lows.\r\n", "department_number": 235}
