{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 3, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "\u00c9tude Canadienne sur l\u2019alimentation totale, Concentrations de contaminants et d'autres produits chimiques dans les aliments composites", "keywords": "ingestion, contaminants, lead, mercury, arsenic, cadmium, pcbs, dioxins, chemicals, pesticides, food supply, detrimental effects, health, consumers, analyse, monitoring, surveillance programs, guidelines, risk to health, total diet study, tds, estimate levels, exposure, age-sex groups, market basket surveys, dietary intakes, toxic, male, female, concentrations, chemicals, scientific research", "data_series_issue_identification": "", "id": "dc5116fb-dab1-4987-8889-6f05709d925c", "metadata_created": "2013-05-24T12:33:11.523258", "subject": ["Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Unknown | Inconnu", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario - Ottawa  Ontario - Ottawa"], "notes_fra": "L'ingestion de quantit\u00e9s excessives de contaminants (tels le plomb, le mercure, l'arsenic, le cadmium, les BPC, les dioxines, etc.) et d'autres substances chimiques (telles les pesticides) par l\u2019approvisionnement alimentaire peut produire des effets nocifs sur la sant\u00e9 des consommateurs. Ainsi, il est essentiel d'analyser les aliments que nous consommons en mettant en \u0153uvre des programmes de contr\u00f4le et de surveillance pour veiller \u00e0 ce que les concentrations de substances chimiques pr\u00e9sentes dans les aliments soient largement conformes aux lignes directrices nationales et internationales.", "digital_object_identifi