  Ontario - Ottawa", "name": "Ontario - Ottawa  Ontario - Ottawa", "revision_timestamp": "2013-05-24T12:33:11.523258", "state": "active", "id": "59303ca0-9604-4332-b7e2-a47f3a57f7df"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-05-24 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "ingestion, contaminants, plomb, mercure, arsenic, cadmium, bpc, dioxines, substances chimiques, pesticides, approvisionnement alimentaire, effets nocifs, sant\u00e9, consommateurs, analyser, programmes de contr\u00f4le, surveillance, lignes directrices, risque pour la sant\u00e9, \u00e9tude sur l'alimentation totale, taux estimatifs, exposition, groupes d'\u00e2ge-sexe, \u00e9tude sur le panier de provisions, estimations des apports alimentaires, toxiques, gar\u00e7ons, filles, femmes, hommes,  concentrations, r\u00e9gime alimentaire, substance chimique, recherche scientifique", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "dc5116fb-dab1-4987-8889-6f05709d925c", "revision_timestamp": "2013-05-24T12:43:33.366924", "organization": {"description": "", "title": "Health Canada | Sant\u00e9 Canada", "created": "2013-05-14T09:17:51.376994", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:51.333174", "is_organization": true, "state": "active", "image_url": "", "revision_id": "94e225c6-b021-43c0-a7df-9beb7a7c1dae", "type": "organization", "id": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "name": "hc-sc"}, "metadata_modified": "2013-06-14T14:34:59.475603", "isopen": false, "url": "", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "url_fra": "", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Canadian Total Diet Study, Concentration of Contaminants and Other Chemicals in Food Composites  ", "revision_id": "eb268eef-7b98-4241-bb6a-bc91b30540dc", "notes": "Ingestion of excessive amounts of contaminants (such as lead, mercury, arsenic, cadmium, PCBs, dioxins) and other chemicals (such as pesticides) through the food supply can have detrimental effects on the health of consumers. Thus, it is essential to analyse the foods we eat for contaminants and other chemicals through regular monitoring and surveillance programs to assure that chemical levels found in foods remain safely within acceptable national and international guidelines.", "department_number": 271}
