{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Base de donn\u00e9es sur les r\u00e9sultats des initiatives horizontaux", "keywords": "Horizontial Initiatives, expenditures, spending, results", "id": "a47734af-deb0-4300-bc0e-f387c7d046a8", "metadata_created": "2013-06-13T20:47:36.330537", "subject": ["Government and Politics  Gouvernement et vie politique"], "language": "eng; CAN | fra; CAN", "spatial_representation_type": "", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "notes_fra": "La base de donn\u00e9es fournit des renseignements sur les ressources financi\u00e8res et non financi\u00e8res pr\u00e9vues et r\u00e9elles en fonction des initiatives horizontales. Des d\u00e9tails sont offerts sur chaque initiative, notamment le minist\u00e8re responsable, la dur\u00e9e de l\u2019initiative, le montant total des fonds affect\u00e9s, une description de l\u2019initiative, les r\u00e9sultats partag\u00e9s, la structure de gouvernance, les partenaires et les coordonn\u00e9es d\u2019une personne-ressource. Les plans, les d\u00e9penses et les r\u00e9sultats sont \u00e9galement disponibles pour chaque p\u00e9riode vis\u00e9e. Ces donn\u00e9es sont disponibles pour les trois ann\u00e9es suivantes: 2011-2012, 20101-2011, et 2009-2010", "state": "draft", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "type": "dataset", "resources": [], "browse_graphic_url": "", "num_resources": 0, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Government and Politics  Gouvernement et vie politique", "name": "Government and Politics  Gouvernement et vie politique", "revision_timestamp": "2013-06-13T20:47:36.330537", "state": "active", "id": "0d5b52e8-6bec-429b-8377-a30d46dc9d95"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "date_published": "2013-06-18 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "groups": [], "organization": {"description": "", "title": "Treasury Board of Canada Secretariat | Secr\u00e9tariat du Conseil du Tr\u00e9sor du Canada", "created": "2013-05-14T09:17:52.973346", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.934216", "is_organization": true, "state": "active", "image_url": "", "revision_id": "180892b6-40fd-457e-8547-92e984d01f35", "type": "organization", "id": "81765FCD-32B3-4708-A593-3AA00705E62B", "name": "tbs-sct"}, "relationships_as_subject": [], "name": "a47734af-deb0-4300-bc0e-f387c7d046a8", "revision_timestamp": "2013-06-13T20:47:36.330537", "metadata_modified": "2013-06-13T20:47:36.330537", "isopen": false, "url": null, "notes": "The Horizontal Initiative database provides planned and actual financial and non-financial information by horizontal initiatives. Details for each initiative include the lead departments, timing of the initiative, the total funding allocation, a description, the shared outcomes, governance structure, partners and a contact name. Plans, spending and results are also available for each identified reporting period. Datasets are available for the following fiscal years: 2011-12, 2010-11, and 2009-10.", "owner_org": "81765FCD-32B3-4708-A593-3AA00705E62B", "keywords_fra": "initiatives horizontaux, d\u00e9penses, r\u00e9sultats ", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Horizontal Initiative Database ", "revision_id": "3550a72b-ae81-457c-901c-4dbf9e43ffa1", "depar