{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Argo: Rapport sur la gestion des donn\u00e9es des profileurs canadiens suivis", "keywords": "Argo,profiling float,float,temperature,salinity,oceans", "data_series_issue_identification": "", "ready_to_publish": false, "id": "caf8efad-1174-42f6-baa9-c4b753275ce5", "metadata_created": "2013-05-14T14:03:32.719350", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "Rapport statistique sur la performance des profileurs d\u00e9rivants", "spatial_representation_type": "", "maintenance_and_update_frequency": "Monthly | Mensuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Environ 3000 profileurs d\u00e9rivants sont d\u00e9ploy\u00e9s \u00e0 l'\u00e9chelle du globe. Une fois en mer, le profileur descend \u00e0 une profondeur cible pr\u00e9d\u00e9termin\u00e9e de 2000 m\u00e8tres pour une p\u00e9riode pr\u00e9d\u00e9termin\u00e9e. Ensuite le profileur refait surface, enregistrant, durant son ascension, les valeurs de temp\u00e9rature et de salinit\u00e9 \u00e0 des niveaux pr\u00e9-\u00e9tablis . Une fois \u00e0 la surface, le profileur d\u00e9rive durant un ou deux jours et transmet les donn\u00e9es recueillies \u00e0 un satellite g\u00e9r\u00e9.-- Le rapport fournit des informations sur la performance des profileurs d\u00e9rivants et graphiques des dur\u00e9e de vie, de volume et type de donn\u00e9es et de la distribution GTS en 24 h des profileurs d\u00e9rivants\n\n", "digital_object_identifier": "", "state": "deleted", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "http://www.meds-sdmm.dfo-mpo.gc.ca/isdm-gdsi/argo/index-fra.html", "type": "dataset", "resources": [{"resource_group_id": "739e587d-f11d-4158-9e92-8658fdce5616", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:14:36.008648", "webstore_last_updated": null, "id": "a3eccd11-67a9-46f0-98bd-906378ec13e1", "size": null, "state": "active", "hash": "", "description": "", "format": "CSV", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN | fra; CAN", "created": "2013-05-14T17:14:36.057027", "url": "http://www.meds-sdmm.dfo-mpo.gc.ca/alphapro/argo/perf_report.csv", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "1ee8a921-0190-4059-89a1-aa843210e128", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-05-14T14:03:32.719350", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "language": "eng; CAN | fra; CAN", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Argro,profileur d\u00e9rivant,profileur,temp\u00e9rature,salinit\u00e9,oc\u00e9ans", "groups": [], "time_period_coverage_start": "1995-01-01 00:00:00", "data_series_name": "Statistics report on Float performance", "relationships_as_subject": [], "name": "caf8efad-1174-42f6-baa9-c4b753275ce5", "time_period_coverage_end": "2010-01-01 00:00:00", "revision_timestamp": "2013-05-28T18:14:47.600593", "organization": {"description": "", "title": "Fisheries and Oceans Canada | P\u00eaches et Oc\u00e9ans Canada", "created": "2013-05-14T09:17:41.042525", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.000783", "is_organization": true, "state": "active", "image_url": "", "revision_id": "ef02f631-8924-4875-8977-49f8a8c67d7d", "type": "organization", "id": "E56460A0-2055-4BF4-A693-EA238E0746E7", "name": "dfo-mpo"}, "metadata_modified": "2013-05-28T18:14:47.600593", "isopen": false, "url": "http://www.meds-sdmm.dfo-mpo.gc.ca/isdm-gdsi/argo/index-eng.html", "endpoint_url": "", "owner_org": "E56460A0-2055-4BF4-A693-EA238E0746E7", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Argo: Canadian Tracked Float Data Management Report", "revision_id": "fe03c414-6a97-4769-967e-c7aff9397421", "notes": "Approximately 3000 profiling floats are deployed around the world. Once at sea, the float sinks to a preprogrammed target depth of 2000 meters for a preprogrammed period of time. It then floats to the surface, taking temperature and salinity values during its ascent at set depths. At the surface, the float drifts along for a day or two and transmits the data to a satellite which then determines the position of the float. -- The report gives Float performance, graphs of float lifetimes, data volume and types and 24-hr GTS distribution.\n\n", "department_number": 253}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "revision_timestamp": "2013-06-01T17:00:36.172168", "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Fichiers des limites cartographiques des provinces et des territoires - Recensement de 2011", "keywords": "census of population, geographic areas, geographic information systems, mapping, province, reference maps, territory", "data_series_issue_identification": "", "ready_to_publish": true, "id": "bab06e04-e6d0-41f1-a595-6cff4d71bedf", "metadata_created": "2013-06-01T16:54:31.550156", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "fichiers des limites", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les fichiers des limites illustrent les limites g\u00e9ographiques utilis\u00e9es \u00e0 la diffusion des donn\u00e9es du recensement. On peut les t\u00e9l\u00e9charger dans deux types de fichiers : cartographiques et num\u00e9riques. Les fichiers des limites cartographiques repr\u00e9sentent les r\u00e9gions g\u00e9ographiques en se servant seulement de la masse terrestre principale du Canada et de ses \u00eeles c\u00f4ti\u00e8res. Les fichiers num\u00e9riques des limites repr\u00e9sentent la totalit\u00e9 du territoire, y compris les rives. Les fichiers fournissent un cadre de cartographie et d'analyse spatiale ax\u00e9 sur des syst\u00e8mes d'information g\u00e9ographique (SIG) ou sur d'autres logiciels de cartographie offerts sur le march\u00e9.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Poly