{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 3, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Projet LiDAR aux environs de Swift Current 2009", "keywords": "drainage,  Remote sensing,  Aerial photography,  Floods ", "data_series_issue_identification": "", "ready_to_publish": true, "id": "34b3b240-8733-4845-b959-132998306a1d", "metadata_created": "2013-06-14T15:57:22.090843", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Grid | Grille", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Saskatchewan  Saskatchewan"], "notes_fra": "McElhanney Consulting Services Ltd (MCSL) a effectu\u00e9 un lev\u00e9 LiDAR et d'imagerie dans le sud de la Saskatchewan. Le but \u00e9tait de g\u00e9n\u00e9rer des MAN pour la mod\u00e9lisation hydraulique des plaines inondables, les cartes topographiques num\u00e9riques, et d'autres produits pour des parties de la vall\u00e9e du ruisseau Swift Current et les autres affluents divers et les vall\u00e9es de cours d'eau connexes dans et autour de la ville de Swift Current. L'acquisition a \u00e9t\u00e9 r\u00e9alis\u00e9e entre le 16 et le 25 Octobre 2009. Le lev\u00e9 comprenait environ 790 kilom\u00e8tres carr\u00e9s de couverture. Durant la collection des donn\u00e9es LiDAR, McElhanney  a acquis des photos a\u00e9riennes en modes RVB et NIR constitu\u00e9s de 1649 images chacune.\r\nEn plus de la principale zone d'int\u00e9r\u00eat, McElhanney a acquis des donn\u00e9es LiDAR et des photos des terres basses adjacentes \u00e0 la zone du projet. Cette zone suppl\u00e9mentaire a \u00e9t\u00e9 acquise sur la sp\u00e9culation que les donn\u00e9es peuvent \u00eatre n\u00e9cessaires \u00e0 l'avenir.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-108, 50], [-108, 51], [-107, 51], [-107, 50]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "fb58163d-ddfa-4fb8-b83c-8c96f33e8356", "cache_last_updated": null, "revision_timestamp": "2013-06-14T18:07:00.598139", "webstore_last_updated": null, "id": "5314ca56-09b4-4b6f-986e-bf4233a02c2a", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-14T11:58:30.976646", "url": "http://www.agr.gc.ca/atlas/data_donnees/elv/aafcSkSwiftCurrent2009/en/fgdb/aafcSkSwiftCurrent2009.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "38f055dd-4822-443f-a49c-3ad2275415e8", "resource_type": "file"}, {"resource_group_id": "fb58163d-ddfa-4fb8-b83c-8c96f33e8356", "cache_last_updated": null, "revision_timestamp": "2013-06-14T15:59:07.162280", "webstore_last_updated": null, "id": "156d3fd6-bf9c-4f9d-a846-054f81f50650", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-14T11:59:07.284190", "url": "http://www.agr.gc.ca/atlas/data_donnees/elv/aafcSkSwiftCurrent2009/fr/fgdb/aacSkSwiftCurrent2009.zip", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "565babcb-4551-4116-b334-730d49bfb685", "resource_type": "file"}, {"resource_group_id": 