 "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "34b3b240-8733-4845-b959-132998306a1d", "revision_timestamp": "2013-06-14T16:03:05.950371", "metadata_modified": "2013-06-14T18:12:25.811018", "isopen": false, "date_modified": "2009-10-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Swift Current LiDAR Project 2009", "revision_id": "2e320fb5-1fad-45a6-bb42-9179eb7f10ed", "notes": "McElhanney Consulting Services Ltd (MCSL) has performed a LiDAR and Imagery survey in southern Saskatchewan. The purpose was to generate DEMs for hydraulic modeling of floodplain, digital terrain maps, and other products for portions of the Swift Current Creek valley and other miscellaneous tributaries and related water course valleys in and around the City of Swift Current. The acquisition was completed between the 16th and 25th of October, 2009. The survey consisted of approximately 790 square kilometers of coverage. While collecting the LiDAR data, McElhanney also acquired aerial photos in RGB and NIR modes consisting of 1649 frames each. \r\nIn addition to the main area of interest, McElhanney has acquired LiDAR data and photos of low lying areas adjacent to the project area. This additional area was acquired on speculation that the data may be required in the future.\r\n", "department_number": 235}
