{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 3, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Sant\u00e9 des amphibiens et contaminants", "keywords": "oil sands, monitoring, biodiversity, contaminants, amphibians", "data_series_issue_identification": "", "id": "e61eb59a-5d39-4a02-a07a-ecfde2ea1b14", "metadata_created": "2013-06-13T18:51:39.786556", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "time_period_coverage_start": "2012-01-01 00:00:00", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Nova Scotia - Digby  Nouvelle-\u00c9cosse - Digby"], "notes_fra": "La sant\u00e9 des amphibiens \u2013 individus et populations \u2013 et de leurs habitats de terres humides est surveill\u00e9e dans la r\u00e9gion des sables bitumineux et sur des sites de r\u00e9f\u00e9rence. Des \u00e9valuations des contaminants sont effectu\u00e9es sur tous les sites. Les amphibiens croissant \u00e0 proximit\u00e9 d'activit\u00e9s d'exploitation des sables bitumineux peuvent \u00eatre expos\u00e9s \u00e0 des concentrations de contaminants li\u00e9s \u00e0 l'exploitation de ces sables par l'entremise des \u00e9missions atmosph\u00e9riques et de la contamination de l'eau. L'objectif des \u00e9tudes sur le terrain consiste \u00e0 \u00e9valuer la sant\u00e9 des populations d'amphibiens sauvages \u00e0 diverses distances des sites d'exploitation des sables bitumineux. Les populations de grenouilles des bois (Lithobates sylvaticus) font actuellement l'objet d'\u00e9tudes en Alberta, en Saskatchewan et dans les Territoires du Nord-Ouest dans le but d'examiner la relation entre la proximit\u00e9 des activit\u00e9s li\u00e9es \u00e0 l'exploitation des sables bitumineux et la pr\u00e9valence de maladies infectieuses, les taux de malformation, les r\u00e9actions endocriniennes, les r\u00e9actions de stress, la g\u00e9notoxicit\u00e9, ainsi que les concentrations de m\u00e9taux lourds, d'acides napht\u00e9niques et d'hydrocarbures aromatiques polycycliques.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Table Digital | Table num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-127.08984,68.99414], [-105.46875,68.99414], [-105.46875,53.34961], [-127.08984,53.34961],[-127.08984,68.99414]]]}", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "c3709142-edff-450c-94eb-4b40ec6d1f72", "cache_last_updated": null, "revision_timestamp": "2013-06-13T18:55:10.649510", "webstore_last_updated": null, "id": "48330bb5-9b61-4088-83d8-9d01c97d472d", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "TBD", "mimetype": null, "cache_url": null, "name_fra": "TBD", "language": "eng; CAN | fra; CAN", "created": "2013-06-13T14:55:10.767115", "url": "http://www.ec.gc.ca", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "9108d992-c90c-4af6-ba45-80a53ed6fc36", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-13T18:51:39.786556", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T18:51:39.786556", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Nova Scotia - Digby  Nouvelle-\u00c9cosse - Digby", "name": "Nova Scotia - Digby  Nouvelle-\u00c9cosse - Digby", "revision_timestamp": "2013-06-13T18:51:39.786556", "state": "active", "id": "a49b1a08-485d-42a8-9ed6-a11afa260a78"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-10-02 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "sables bitumineux, surveillance, biodiversit\u00e9, contaminants, amphibiens", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "e61eb59a-5d39-4a02-a07a-ecfde2ea1b14", "revision_timestamp": "2013-06-13T18:55:43.216283", "organization": {"description": "", "title": "Environment Canada | Environnement Canada", "created": "2013-05-14T09:17:41.395797", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.354936", "is_organization": true, "state": "active", "image_url": "", "revision_id": "18112ac5-2ef2-4519-ad05-a58dc9985d41", "type": "organization", "id": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "name": "ec"}, "metadata_modified": "2013-06-13T18:55:43.216283", "isopen": false, "url": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=en", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "url_fra": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=fr", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Amphibian Health and Contaminants", "revision_id": "998cfd3e-eaf1-4d71-a574-e16bc638ec97", "notes": "The health of individual amphibians, amphibian populations, and their wetland habitats are monitored in the oil sands region and at reference locations. Contaminants assessments are done at all sites. Amphibians developing near oil sands activities may be exposed to concentrations of oil sands-related contaminants, through air emissions as well as water contamination. The focus of field investigations is to evaluate the health of wild amphibian populations at varying distances from oil sands operations. Wood frog (Lithobates sylvaticus) populations are being studied in Alberta, Saskatchewan and the Northwest Territories in order to examine the relationship of proximity to oil sands activities and to prevalence of infectious diseases, malformation rates, endocrine and stress responses, genotoxicity, and concentrations of heavy metals, naphthenic acids and polycyclic aromatic hydrocarbons.", "department_number": 99}
