{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Vagues", "keywords": "waves,GOES,ARGOS,wave spectra", "data_series_issue_identification": "", "id": "e1091800-6f21-45e4-8bff-fb12bbc42ae2", "metadata_created": "2013-05-14T14:03:32.255386", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "", "time_period_coverage_start": "1970-04-27 00:00:00", "maintenance_and_update_frequency": "Weekly | Hebdomadaire", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Le Gestion des donn\u00e9es scientifiques int\u00e9gr\u00e9es (GDSI) acquiert, traite, contr\u00f4le la qualit\u00e9 et distribue des donn\u00e9es sur les vagues de surface. Des donn\u00e9es spectrales sur les vagues sont diffus\u00e9es sur les r\u00e9seaux GOES et ARGOS et sont trait\u00e9es chaque jour.\r\n*** La totalit\u00e9 des 6 millions de spectres de vagues que nous avons observ\u00e9s ainsi que certains produits sp\u00e9cialis\u00e9s sont maintenant disponibles en ligne. S'il vous pla\u00eet noter que les donn\u00e9es sont mises \u00e0 jour sur une base hebdomadaire seulement.  ", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "0e165f37-33ac-4271-b4d9-f4f4efffb76d", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:14:36.022564", "webstore_last_updated": null, "id": "6c93477e-1c5b-4f89-8933-9492cbe56d28", "size": null, "state": "active", "hash": "", "description": "", "format": "HTML", "tracking_summary": {"total": 0