{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "APECA - Divulgation des contrats de plus de 10 000 $", "keywords": "Atlantic Canada Opportunities Agency,ACOA,Atlantic Canada,contracting,contracts,disclosure,proactive disclosure,procurement", "data_series_issue_identification": "", "id": "8c9fdaf7-1039-40fa-8805-77f52905d300", "metadata_created": "2013-06-07T20:24:02.816387", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "", "spatial_representation_type": "", "time_period_coverage_start": "2004-03-15 00:00:00", "maintenance_and_update_frequency": "Quarterly | Trimestriel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Atlantic  Atlantique"], "notes_fra": "Cet ensemble de donn\u00e9es offre des renseignements sur les contrats conclus par l\u2019Agence de promotion \u00e9conomique du Canada atlantique ou en son nom. Le 23 mars 2004, le gouvernement a annonc\u00e9 une nouvelle politique sur la publication obligatoire des contrats de plus de 10 000 $. Le 19 juin 2008, la politique a chang\u00e9 afin d\u2019exiger aussi la divulgation des modifications de march\u00e9s d\u2019une valeur sup\u00e9rieure \u00e0 10 000 $. \u00c0 compter du 31 octobre 2012, conform\u00e9ment aux modifications apport\u00e9es aux Lignes directrices sur la divulgation proactive des march\u00e9s, les contrats de plus de 10 000 $ conclus apr\u00e8s le 1er janvier 2013 avec des anciens fonctionnaires touchant une pension en vertu de la Loi sur la pension de la fonction publique devront \u00eatre d\u00e9finis comme tels. Les r\u00e8gles et principes qui r\u00e9gissent les contrats de l\u2019\u00c9tat sont d\u00e9crits dans la Politique sur les march\u00e9s du Conseil du Tr\u00e9sor. L\u2019objectif des contrats de l\u2019\u00c9tat est d\u2019acqu\u00e9rir des biens et services, y compris des services de construction, d\u2019une mani\u00e8re qui am\u00e9liore l\u2019acc\u00e8s, renforce la concurrence et garantit la meilleure valeur au Canada.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "d47dd3b2-e810-475c-8019-8d46ad216547", "cache_last_updated": null, "revision_timestamp": "2013-06-07T20:25:22.134458", "webstore_last_updated": null, "id": "5c6c6f01-e3cf-4c18-a79e-7349bd626b63", "size": null, "state": "active", "hash": "", "description": "", "format": "CSV", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-07T16:25:22.263904", "url": "http://data.acoa-apeca.gc.ca/Contracts/CSVHandler.ashx?lang=en", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "e6fab7db-ff35-42d1-b7b6-4c98367fbb64", "resource_type": "file"}, {"resource_group_id": "d47dd3b2-e810-475c-8019-8d46ad216547", "cache_last_updated": null, "revision_timestamp": "2013-06-07T20:25:53.068369", "webstore_last_updated": null, "id": "6b31ad89-9f5a-4a85-9a2e-88072471eca6", "size": null, "state": "active", "hash": "", "description": "", "format": "CSV", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-07T16:25:53.147907", "url": "http://data.acoa-apeca.gc.ca/Contracts/CSVHandler.ashx?lang=fr", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "0241e745-3864-47e3-ab16-836c01925aee", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 2, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Atlantic  Atlantique", "name": "Atlantic  Atlantique", "revision_timestamp": "2013-06-07T20:40:18.892346", "state": "active", "id": "c7ec122f-14b7-4447-aaeb-53def03d58c6"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Government and Politics  Gouvernement et vie politique", "name": "Government and Politics  Gouvernement et vie politique", "revision_timestamp": "2013-06-07T20:24:02.816387", "state": "active", "id": "0d5b52e8-6bec-429b-8377-a30d46dc9d95"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "http://data.acoa-apeca.gc.ca/Contracts/WebService.asmx?WSDL", "date_published": "2013-06-07 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Agence de promotion \u00e9conomique du Canada atlantique,APECA,Canada atlantique,acquisition,contrats,divulgation,divulgation proactive,march\u00e9s", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "8c9fdaf7-1039-40fa-8805-77f52905d300", "revision_timestamp": "2013-06-07T20:31:25.291584", "organization": {"description": "", "title": "Atlantic Canada Opportunities Agency | Agence de promotion \u00e9conomique du Canada atlantique", "created": "2013-05-14T09:17:33.777740", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.709906", "is_organization": true, "state": "active", "image_url": "", "revision_id": "c1eca7dd-7f2e-4a1b-a93c-8568d3133c2c", "type": "organization", "id": "C3DDAD27-EFA9-41AB-9D12-12856482C0A8", "name": "acoa-apeca"}, "metadata_modified": "2013-06-07T20:40:18.892346", "isopen": false, "date_modified": "2013-06-07 00:00:00", "url": "http://www.acoa-apeca.gc.ca/Eng/", "language": "eng; CAN | fra; CAN", "endpoint_url": "http://data.acoa-apeca.gc.ca/Contracts/WebService.asmx?WSDL", "owner_org": "C3DDAD27-EFA9-41AB-9D12-12856482C0A8", "url_fra": "http://www.acoa-apeca.gc.ca/Fra/", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "ACOA - Disclosure of Contracts Over $10,000", "revision_id": "260505f0-22a6-4ee3-ab21-5a55797c5ace", "notes": "This dataset provides information on contracts issued by or on behalf of the Atlantic Canada Opportunities Agency. On March 23, 2004, the Government announced a new policy on the mandatory publication of contracts over $10,000. On June 19, 2008, the policy was changed to also require the disclosure of contract amendments valued over $10,000. Effective October 31, 2012, amendments to the Guidelines on the Proactive Disclosure of Contracts require that contracts over $10,000 issued to former public servants in receipt of a pension under the Public Service Superannuation Act after January 1, 2013 be identified as such. The rules and principles governing government contracting are outlined in the Treasury Board Contracting Policy. The objective of government procurement contracting is to acquire goods and services, including construction services, in a manner that enhances access, competition and fairness and results in best value to Canada.", "department_number": 276}
