itle": "Circa 1995 Landcover of the Prairies", "revision_id": "0d826750-aaf7-47ca-9363-50faf09ebe13", "notes": "The \u2018Circa 1995 Landcover of the Prairies\u2019 dataset is a geospatial raster data layer portraying the rudimentaryland cover types of all grain-growing areas of Manitoba, Saskatchewan, Alberta and northeastern British Columbia at a 30-metre resolution for the 1995 timeframe. It is the collection of all the classified imagery (1993 to 1995) of the Western Grain Transition Payment Program (WGTPP) assembled into a single seamless raster data layer.", "department_number": 235}
