{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 8, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Donn\u00e9es interpol\u00e9es du Recensement de l'agriculture ", "keywords": "Land management, Dairy products, Agri-food products, Fertilizers, Pesticides, Agricultural technology, Irrigation, Agricultural economics ", "data_series_issue_identification": "", "ready_to_publish": true, "id": "573098c4-60d1-4f11-9046-681c219a4d0b", "metadata_created": "2013-06-05T20:24:59.470602", "subject": ["Agriculture  Agriculture"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Prairies  Prairies", "Quebec  Qu\u00e9bec", "Territories  Territoires", "Ontario  Ontario", "British Columbia  Colombie-Britannique", "Atlantic  Atlantique"], "notes_fra": "Le Recensement de l\u2019agriculture est diffus\u00e9 selon les unit\u00e9s g\u00e9ographiques normalis\u00e9es (limites) de Statistique Canada. \u00c9tant donn\u00e9 que ces unit\u00e9s de recensement ne sont ni le reflet ni l\u2019\u00e9quivalent d\u2019unit\u00e9s biophysiques du paysage (les \u00e9cor\u00e9gions, les p\u00e9do-paysages ou les bassins versants, par exemple), Agriculture et Agroalimentaire Canada, en collaboration avec la Division de l\u2019agriculture de Statistique Canada, a mis au point un processus d\u2019interpolation (r\u00e9affectation ou r\u00e9partition au prorata) des donn\u00e9es du Recensement de l\u2019agriculture de fa\u00e7on \u00e0 passer des unit\u00e9s polygonales de recensement \u00e0 des unit\u00e9s polygonales biophysiques.\r\nDans les \u00ab Donn\u00e9es interpol\u00e9es du Recensement de l\u2019agriculture \u00bb, des proc\u00e9dures de suppression des donn\u00e9es pour des raisons de confidentialit\u00e9 ont \u00e9t\u00e9 appliqu\u00e9es par Statistique Canada aux tables personnalis\u00e9es pour que l\u2019on ne puisse pas associer des donn\u00e9es statistiques \u00e0 une exploitation agricole en particulier ou \u00e0 un exploitant identifiable. La valeur \u00ab -1 \u00bb qui figure dans les cellules de donn\u00e9es indique que l\u2019information a \u00e9t\u00e9 supprim\u00e9e par Statistique Canada afin de prot\u00e9ger la confidentialit\u00e9 des r\u00e9pondants. Les valeurs nulles ou les cellules vides indiquent tout simplement qu\u2019aucune donn\u00e9e n\u2019a \u00e9t\u00e9 d\u00e9clar\u00e9e.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "faf0f270-3fb1-47a3-a145-97cc0a6c89ad", "cache_last_updated": null, "revision_timestamp": "2013-06-12T20:01:29.741848", "webstore_last_updated": null, "id": "ad33e3ad-82b4-41de-b44a-e746de698da8", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-05T16:26:48.315781", "url": "http://www.agr.gc.ca/atlas/data_donnees/agr/interpolatedCoA/en/fgdb/InterpolatedCoA.zip ", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "4db244b2-f3f0-467e-a3c4-8985cfa4978c", "resource_type": "file"}, {"resource_group_id": "faf0f270-3fb1-47a3-a145-97cc0a6c89ad", "cache_last_updated": null, "revision_timestamp": "2013-06-12T20:02:05.925041", "webstore_last_updated": null, "