polatedCoA/fr/", "webstore_url": null, "last_modified": null, "position": 3, "revision_id": "881dfcc6-69b6-4b6e-8ce4-d25d70514b7c", "resource_type": "doc"}], "browse_graphic_url": "http://www.agr.gc.ca/atlas/supportdocument_documentdesupport/interpolatedCoA/iMap_agCensus.gif", "num_resources": 4, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Farming  Agriculture"], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Agriculture  Agriculture", "name": "Agriculture  Agriculture", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "6d82a7f3-c145-4795-aa97-af8044a0c05c"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Atlantic  Atlantique", "name": "Atlantic  Atlantique", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "c7ec122f-14b7-4447-aaeb-53def03d58c6"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "British Columbia  Colombie-Britannique", "name": "British Columbia  Colombie-Britannique", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "e756881c-4781-4f15-b03b-1bc0f6688665"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Farming  Agriculture", "name": "Farming  Agriculture", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "45aef9e7-a671-45e6-ab70-ec51da90269a"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Ontario  Ontario", "name": "Ontario  Ontario", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "170ff7c8-314d-4801-853c-97c87b308aa9"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Quebec  Qu\u00e9bec", "name": "Quebec  Qu\u00e9bec", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "db38a71d-cc91-40b2-b3de-a893f2fc46be"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Territories  Territoires", "name": "Territories  Territoires", "revision_timestamp": "2013-06-05T20:24:59.470602", "state": "active", "id": "c6c59b71-ac42-4d28-a607-4a87aba661c7"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-05 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Gestion des terres, Produits laitiers, Produits agroalimentaires, Engrais, Pesticides, Technologie agricole, Irrigation, Agro\u00e9conomie ", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "573098c4-60d1-4f11-9046-681c219a4d0b", "revision_timestamp": "2013-06-12T20:10:01.346696", "metadata_modified": "2013-06-12T20:10:01.346696", "isopen": false, "date_modified": "2008-04-30 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Interpolated Census of Agriculture", "revision_id": "1cf7357c-961b-418d-aace-ba050d1fedf3", "notes": "The Census of Agriculture is disseminated by Statistics Canada's standard geographic units (boundaries). Since these census units do not reflect or correspond with biophysical landscape units (such as ecological regions, soil landscapes or drainage areas), Agriculture and Agri-Food Canada in collaboration with Statistics Canada's Agriculture Division, have developed a process for interpolating (reallocating or proportioning) Census of Agriculture information from census polygon-based units to biophysical polygon-based units.\r\n\r\nIn the \u201cInterpolated census of agriculture\u201d, suppression confidentiality procedures were applied by Statistics Canada to the custom tabulations to prevent the possibility of associating statistical data with any specific identifiable agricultural operation or individual. Confidentiality flags are denoted where \"-1\" appears in data cell. This indicates information has been suppressed by Statistics Canada to protect confidentiality. Null values/cells simply indicate no data is reported.", "department_number": 235}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Fichiers num\u00e9riques des limites des localit\u00e9s d\u00e9sign\u00e9es - Recensement de 2006", "keywords": "census of population, designated place, geographic areas, geographic information systems, mapping, reference maps", "data_series_issue_identification": "", "ready_to_publish": true, "id": "cdc6b95a-cf55-4a7d-a77f-fea5cbbf6d93", "metadata_created": "2013-06-03T01:42:52.798365", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "fichiers des limites", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les Fichiers des limites des localit\u00e9s d\u00e9sign\u00e9es illustrent les limites des localit\u00e9s d\u00e9sign\u00e9es pour lesquelles les donn\u00e9es du recensement sont diffus\u00e9es. On peut les t\u00e9l\u00e9charger dans deux types de fichiers : cartographiques et num\u00e9riques. Les fichiers des limites cartographiques repr\u00e9sentent les r\u00e9gions g\u00e9ographiques en se servant seulement de la masse terrestre principale du Canada et de ses \u00eeles c\u00f4ti\u00e8res. Les fichiers num\u00e9riques des limites repr\u00e9sentent la totalit\u00e9 du territoire, y compris les rives. Les fichiers fournissent un cadre de cartographie et d'analyse spatiale ax\u00e9 sur des syst\u00e8mes d'information g\u00e9ographique (SIG) ou sur d'autres logiciels de cartographie offerts sur le march\u00e9.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique",