p://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Ambient Gases and Particles", "revision_id": "0f872203-1dab-4778-8855-e86a6c3aed21", "notes": "Several types of Ambient Gases and Particles data are available for download depending on site:\r\n- Filter Pack (24-hour integrated concentrations of particle-bound SO42-, NO3-, Cl-, NH4+, Ca2+, Mg2+, Na+, K+ and gaseous SO2 and HNO3 collected daily by the Canadian Air and Precipitation Monitoring Network)\r\n- Ozone (hourly mixing ratios measured by the Canadian Air and Precipitation Monitoring Network)\r\n - Total Gaseous Mercury (hourly mixing ratios measured by the Canadian Air and Precipitation Monitoring Network and Prairie and Northern Region)\r\n- Polycyclic Aromatic Compounds (PACs) - Passive Sampling (monthly or bimonthly integrated concentrations of PACs in PUF disk-type passive air samplers (normalized to deployment time, per day)", "department_number": 99}
