{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Liste d'importateurs reconnus pour le programme d'autorisation pr\u00e9alable  - Annexe G", "keywords": "Vehicle, Import, Importer", "data_series_issue_identification": "", "ready_to_publish": true, "id": "897e92f5-8b08-42bd-9766-0852be02e4ff", "metadata_created": "2013-06-06T19:26:47.878532", "subject": ["Transport  Transport"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Daily | Quotidien", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Cette liste permet \u00e0 l\u2019Agence des services frontaliers du Canada d\u2019identifier les importateurs commerciaux de moins de 2,500 v\u00e9hicules neufs par ann\u00e9e (neuf = n'ayant jamais \u00e9t\u00e9 la propri\u00e9t\u00e9 de quiconque ou immatricul\u00e9s), enti\u00e8rement conformes aux sp\u00e9cifications canadiennes pr\u00e9sent\u00e9 aux points d'entr\u00e9e frontaliers. Si l\u2019importateur est sur la liste, les v\u00e9hicules peuvent \u00eatre import\u00e9s directement avec un examen moins rigoureux par les douanes aux ports d'entr\u00e9e canadien d\u00e9sign\u00e9.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "", "type": "dataset", "resources": [{"resource_group_id": "5401e98b-57a3-4045-a254-40a392e61f02", "cache_last_updated": null, "revision_timestamp": "2013-06-10T14:36:36.340774", "webstore_last_updated": null, "id": "162be2f7-d332-426e-871c-d9562c0de43d", "size": null, "state": "active", "hash": "", "description": "", "format": "XML", "tracking_summary": {"total": 0, "recent":