_subject": [], "name": "bcdb6685-c1cf-4664-8b4e-63dc9e6921c5", "time_period_coverage_end": "2006-01-01 00:00:00", "revision_timestamp": "2013-06-02T23:25:54.135050", "organization": {"description": "", "title": "Statistics Canada | Statistique Canada", "created": "2013-05-14T09:17:52.316230", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.272382", "is_organization": true, "state": "active", "image_url": "", "revision_id": "87fcd1c4-2bd0-4977-ab91-3622e73393e2", "type": "organization", "id": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "name": "statcan"}, "metadata_modified": "2013-06-02T23:25:54.135050", "isopen": false, "url": "http://www12.statcan.gc.ca/census-recensement/2011/geo/index-eng.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Federal Electoral District Cartographic Boundary Files - 2006 Census", "revision_id": "86bb4a84-d3b1-4e09-8485-1109764d72b4", "notes": "The Federal Electoral District Boundary Files portray the federal electoral district boundaries for which census data are disseminated. They are available for download in two types: cartographic and digital. Cartographic boundary files depict the geographic areas using only the shorelines of the major land mass of Canada and its coastal islands. Digital boundary files depict the full extent of the geographic areas, including the coastal water area. The files provide a framework for mapping and spatial analysis using commercially available geographic information systems (GIS) or other mapping software.\r\n", "department_number": 256}
