{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 4, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Tableaux du Guide de donn\u00e9es sur la consommation d'\u00e9nergie (Canada) - Secteur r\u00e9sidentiel", "keywords": "energy", "data_series_issue_identification": "", "ready_to_publish": true, "id": "27155507-0644-4077-9a97-7b268dfd8e58", "metadata_created": "2013-06-04T13:48:31.279867", "subject": ["Nature and Environment  Nature et environnement", "Economics and Industry  \u00c9conomie et industrie"], "data_series_name_fra": "Tableaux du Guide de donn\u00e9es sur la consommation d'\u00e9nergie (Canada) - Secteur r\u00e9sidentiel", "spatial_representation_type": "", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Statistique Canada pr\u00e9sente les donn\u00e9es globales sur la consommation d\u2019\u00e9nergie dans le secteur r\u00e9sidentiel dans son Bulletin sur la disponibilit\u00e9 et \u00e9coulement d\u2019\u00e9nergie au Canada (le Bulletin) [no de cat. 57-003-X]. Afin de fournir davantage de d\u00e9tails sur la fa\u00e7on dont cette \u00e9nergie est consomm\u00e9e, l\u2019Office de l\u2019efficacit\u00e9 \u00e9nerg\u00e9tique (OEE) a mis au point le Mod\u00e8le d\u2019utilisation finale pour le secteur r\u00e9sidentiel (le Mod\u00e8le). Ce mod\u00e8le de comptabilit\u00e9 sert \u00e0 \u00e9valuer l\u2019\u00e9volution de la consommation d\u2019\u00e9nergie dans le secteur r\u00e9sidentiel canadien. Cela est obtenu en r\u00e9partissant la consommation d\u2019\u00e9nergie rapport\u00e9e dans le Bulletin par utilisation finale, en utilisant les donn\u00e9es annuelles sur les caract\u00e9ristiques du parc de logements et l\u2019\u00e9quipement r\u00e9sidentiel et sur les ventes en conjonction avec le profil d\u2019utilisation et la consommation unitaire d\u2019\u00e9nergie (CUE) du stock d\u2019\u00e9quipement. Le Mod\u00e8le subdivise les donn\u00e9es par province, et inclut quatre types de b\u00e2timents, cinq utilisations finales, huit cat\u00e9gories de p\u00e9riodes de construction de maisons et six types de combustible. Certaines donn\u00e9es sont \u00e9galement r\u00e9parties en fonction du type d\u2019\u00e9quipement.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "http://oee.nrcan.gc.ca/organisme/statistiques/bnce/apd/guide_res_ca.cfm?attr=0", "type": "dataset", "resources": [{"resource_group_id": "7b41b211-63a3-4be3-936c-85fb073ac204", "cache_last_updated": null, "revision_timestamp": "2013-06-04T14:22:27.166217", "webstore_last_updated": null, "id": "32abe6e0-5f39-4190-8868-3881b5ed57b2", "size": null, "state": "active", "hash": "", "description": "", "format": "XLS", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Residential Secondary Energy Use by Energy Source and End-Use", "mimetype": null, "cache_url": null, "name_fra": "Consommation d'\u00e9nergie secondaire du secteur r\u00e9sidentiel par source d'\u00e9nergie et utilisation finale", "language": "eng; CAN", "created": "2013-06-04T09:50:47.198838", "url": "http://oee.nrcan.gc.ca/corporate/statistics/neud/dpa/tableshandbook2/res_00_1_e.xls", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "8edf13b7-e71d-493b-8dec-960e8932c07e", "resource_type": "file"}, {"resource_group_id": "7b41b211-63a3-4be3-936c-85fb073ac204", "cache_last_updated": null, "revision_timestamp": "2013-06-04T13:52:18.510733", "webstore_last_updated": null, "id": "e767a8b5-74c5-413f-9b0e-468bf461e872", "size": null, "state": "active", "hash": "", "description": "", "format": "XLS", "tracking_summary": {"