et environnement", "revision_timestamp": "2013-06-04T13:48:31.279867", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-01-02 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "\u00e9nergie", "groups": [], "time_period_coverage_start": "1990-01-01 00:00:00", "data_series_name": "Energy Use Data Handbook Tables (Canada) - Residential Sector", "relationships_as_subject": [], "name": "27155507-0644-4077-9a97-7b268dfd8e58", "time_period_coverage_end": "2010-12-31 00:00:00", "revision_timestamp": "2013-06-04T13:58:44.119060", "organization": {"description": "", "title": "Natural Resources Canada | Ressources naturelles Canada", "created": "2013-05-14T09:17:50.702841", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:50.661629", "is_organization": true, "state": "active", "image_url": "", "revision_id": "eee0be83-842c-4ad4-b36a-fbf8fbcb6b0a", "type": "organization", "id": "9391E0A2-9717-4755-B548-4499C21F917B", "name": "nrcan-rncan"}, "metadata_modified": "2013-06-06T13:56:04.685947", "isopen": false, "url": "http://oee.nrcan.gc.ca/corporate/statistics/neud/dpa/handbook_res_ca.cfm?attr=0", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "9391E0A2-9717-4755-B548-4499C21F917B", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Energy Use Data Handbook Tables (Canada) - Residential Sector", "revision_id": "49950073-70b4-47a3-a9f5-41efa5d757ff", "notes": "Aggregate data on residential energy use are reported in Statistics Canada\u2019s Report on Energy Supply-Demand in Canada (RESD) (Cat. No. 57-003-X). To provide more detail on how this energy is used, the Office of Energy Efficiency (OEE) has developed the Residential End-Use Model (REUM). This stock accounting model assesses trends in energy use in the Canadian residential sector by allocating the energy use reported in the RESD to end-uses using annual stock characteristics and sales data, coupled with usage profiles and unit energy consumption for equipment stock. It is disaggregated at the provincial level and includes four building types, five end-uses, eight vintage categories (house age categories) and six fuel types. Some end-uses are further disaggregated by equipment type.", "department_number": 115}
