 "revision_id": "94e225c6-b021-43c0-a7df-9beb7a7c1dae", "type": "organization", "id": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "name": "hc-sc"}, "metadata_modified": "2013-05-16T17:41:39.750933", "isopen": false, "url": "", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "url_fra": "", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Notice of Compliance Veterinary Species ", "revision_id": "d801bf16-6e4f-402d-b30b-1d39aa989a2a", "notes": "A Notice of Compliance is a notification, issued pursuant to paragraph C.08.004(1)(a), indicating that a manufacturer has complied with sections C.08.002 or C.08.003 and C.08.005.1 of the Food and Drug Regulations. Notices of Compliance are issued to a manufacturer following the satisfactory review of a submission.\r\n\r\nThe NOC extract files contain Health Canada authorization dates for all drugs dating back to 1994 that have received an NOC.  There are four types of NOCs: Biological, Prescription, Nonprescription and Veterinary.  This data extract contains information on Notice of Compliance Veterinary Species.\r\n", "department_number": 271}
