{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Vagues: Trac\u00e9s archiv\u00e9s", "keywords": "waves,GOES,ARGOS,wave spectra,Atlantic", "data_series_issue_identification": "", "ready_to_publish": false, "id": "86a0937a-a1c5-48ee-82f0-5444984c440c", "metadata_created": "2013-05-14T14:03:32.941654", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "Trac\u00e9s chronologiques mensuels des donn\u00e9es individulles des stations", "spatial_representation_type": "", "maintenance_and_update_frequency": "Weekly | Hebdomadaire", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Nova Scotia  Nouvelle-\u00c9cosse"], "notes_fra": "\"Le Gestion des donn\u00e9es scientifiques int\u00e9gr\u00e9es (GDSI) acquiert, traite, contr\u00f4le la qualit\u00e9 et distribue des donn\u00e9es sur les vagues de surface. Des donn\u00e9es spectrales sur les vagues sont diffus\u00e9es sur les r\u00e9seaux GOES et ARGOS et sont trait\u00e9es chaque jour.\n*** La totalit\u00e9 des 6 millions de spectres de vagues que nous avons observ\u00e9s ainsi que certains produits sp\u00e9cialis\u00e9s sont maintenant disponibles en ligne. S'il vous pla\u00eet noter que les donn\u00e9es sont mises \u00e0 jour sur une base hebdomadaire seulement. - Trac\u00e9s chronologiques mensuels contenant les donn\u00e9es de diff\u00e9rentes stations.\n\n\"\n", "digital_object_identifier": "", "state": "deleted", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "http://www.meds-sdmm.dfo-mpo.gc.ca/isdm-gdsi/waves-vagues/index-fra.htm", "type": "dataset", "resources": [{"resource_group_id": "56291b8f-30dc-4dd1-b921-da877d3c3157", "cac