{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 5, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Projet des bassins hydrographiques d\u2019AAC (2012)", "keywords": "Watersheds, Hydrology, Water, Drainage, Inland Waters, Western Provinces ", "data_series_issue_identification": "", "ready_to_publish": true, "id": "79a52180-6cae-4b7c-bec1-96f02144a1ec", "metadata_created": "2013-06-03T15:30:52.847039", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Prairies  Prairies"], "notes_fra": "Les s\u00e9ries de niveaux du Projet des bassins hydrographiques d\u2019Agriculture et Agroalimentaire Canada (AAC) fournissent un certain nombre de jeux de donn\u00e9es sur des bassins hydrographiques et en lien avec des bassins hydrographiques pour les provinces des Prairies. Les niveaux sont des petits ou des gros assemblages de zones hydrom\u00e9triques ou des composantes qui les d\u00e9finissent. \r\nLe Projet est organis\u00e9 selon les stations hydrom\u00e9triques qui sont fournies par Environnement Canada, les \u00c9tats-Unis et des provinces canadiennes. Des stations additionnelles ont \u00e9t\u00e9 g\u00e9n\u00e9r\u00e9es pour r\u00e9gler les probl\u00e8mes structuraux, comme les confluences de rivi\u00e8re ou les bras de lacs. Collectivement, elles sont d\u00e9sign\u00e9es comme les stations hydrom\u00e9triques, ou tout simplement les stations.\r\nLa superficie des bassins surveill\u00e9e par chaque station, entre elle-m\u00eame et ses stations voisines d\u2019amont, est appel\u00e9e \u00ab superficie brute diff\u00e9rentielle des bassins hydrographiques \u00bb. \r\nLes superficies brutes diff\u00e9rentielles des bassins hydrographiques sont int\u00e9gr\u00e9es dans des regroupements plus grands ou plus petits d\u2019apr\u00e8s la taille ou l\u2019int\u00e9r\u00eat d\u00e9fini de g\u00e9n\u00e9rer divers \u00ab niveaux \u00bb de s\u00e9ries. Ces s\u00e9ries comprennent ce qui suit.\r\nBassins de diverses superficies :\r\n1.\tprincipaux r\u00e9seaux hydrographiques (3) : oc\u00e9an Arctique, baie d\u2019Hudson et golfe du Mexique;\r\n2.\tprincipaux bassins (23) : associ\u00e9s \u00e0 des tron\u00e7ons de rivi\u00e8re ou de lac; \r\n3.\tsous-bassins du Projet (47) : cr\u00e9\u00e9s sp\u00e9cifiquement pour le Projet; \r\n4.\tsous-bassins (51) : bas\u00e9s sur les emplacements de stations hydrom\u00e9triques sp\u00e9cifiques d\u2019Environnement Canada;\r\n5.\tsous-sous-bassins (311) : bas\u00e9s sur les emplacements de stations hydrom\u00e9triques sp\u00e9cifiques d\u2019Environnement Canada.\r\nSuperficies diff\u00e9rentielles des bassins hydrographiques :\r\n6.\tsuperficies brutes diff\u00e9rentielles des bassins hydrographiques : une par station hydrom\u00e9trique.\r\nLes superficies brutes diff\u00e9rentielles des bassins hydrographiques sont sous-divis\u00e9es en parties qui contribuent ou non \u00e0 l\u2019\u00e9coulement lors d\u2019un \u00e9pisode de ruissellement moyen. La superficie effective de drainage comprend les parties qui contribuent au ruissellement, et la superficie \u00e0 contribution nulle comprend les parties qui ne contribuent pas au ruissellement. Ces concepts g\u00e9n\u00e8rent les niveaux suivants : \r\n7.\tsuperficies effectives diff\u00e9rentielles des bassins hydrographiques;\r\n8.\tsuperficies diff\u00e9rentielles \u00e0 contribution nulle.\r\nSuperficies totales des bassins hydrographiques :\r\n9.\tsuperficies brutes totales des bassins hydrographiques;\r\n10.\tsuperficies effectives totales des bassins hydrographiques;\r\n11.\tsuperficies totales \u00e0 contribution nulle. \r\nLorsqu\u2019elles sont combin\u00e9es pour l\u2019ensemble du projet, on obtient :\r\n12.\tla superficie effective des bassins hydrographiques.\r\nLes s\u00e9ries comprennent aussi ces composantes :\r\n13.\tles stations hydrom\u00e9triques;\r\n14.\tl\u2019ensemble des limites (lignes) des superficies brutes diff\u00e9rentielles des bassins hydrographiques ainsi que des limites qui s\u00e9parent les parties effectives des parties \u00e0 contribution nulle pour un \u00e9pisode de ruissellement moyen;\r\n15.\tun r\u00e9seau de lignes orient\u00e9es vers l\u2019aval qui relie les stations hydrom\u00e9triques.\r\nToutes les lignes sont d\u00e9riv\u00e9es des donn\u00e9es topographiques \u00e0 grande \u00e9chelle.\r\nUn jeu de donn\u00e9es non spatiales suppl\u00e9mentaire, soit un tableau de valeurs cumul\u00e9es par station hydrom\u00e9trique, est fourni :\r\n16.\tle tableau du Projet des stations hydrom\u00e9triques.\r\nLa zone du Projet, \u00e9labor\u00e9e pour les provinces des Prairies, comprend la totalit\u00e9 de l\u2019Alberta, de la Saskatchewan et du Manitoba, et les parties de la Colombie-Britannique, des Territoires du Nord Ouest, du Nunavut, de l\u2019Ontario et des \u00c9tats-Unis requises pour compl\u00e9ter les parties transfrontali\u00e8res des bassins hydrographiques.\r\nDepuis 1975, le Projet des bassins hydrographiques d\u2019AAC recueille et affine syst\u00e9matiquement des donn\u00e9es sur les limites des bassins hydrographiques des Prairies. Le r\u00e9sultat est une source qui fait autorit\u00e9 pour les superficies brutes et effectives des bassins hydrographiques dans les provinces des Prairies. Les d\u00e9limitations analogues initiales \u00e0 l\u2019\u00e9chelle de 1/50 000 ont \u00e9t\u00e9 converties en format num\u00e9rique en 1994. Depuis, l\u2019exactitude et l\u2019\u00e9tendue des d\u00e9limitations se sont accrues, et les niveaux de s\u00e9ries sont rendus au nombre de 16.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-124, 45], [-124, 61], [-90, 61], [-90, 45]]]}", "license_id": "ca-ogl-lgo", "url_fra": "www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "1fa856f8-8bf0-4cc7-92e5-b56490026362", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:59:02.430625", "webstore_last_updated": null, "id": "f12d6c9e-9afa-46c1-b591-edd37789a404", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-03T11:33:54.469621", "url": "http://www.agr.gc.ca/atlas/data_donnees/hyd/aafcWatersheds2012/fr/fgdb/bassinHydrographiqueAac2012.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "d958ae80-503a-4e98-ad88-37d6b829f247", "resource_type": "file"}, {"resource_group_id": "1fa856f8-8bf0-4cc7-92e5-b56490026362", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:59:40.290535", "webstore_last_updated": null, "id": "960ec258-ba19-417d-9b29-6067092e969a", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-03T11:37:29.759197", "url": "http://www.agr.gc.ca/atlas/data_donnees/hyd/aafcWatersheds2012/en/fgdb/aafcWatersheds2012.zip", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "35da74fa-5640-4a08-a16f-aaf6236ef8e6", "resource_type": "file"}, {"resource_group_id": "1fa856f8-8bf0-4cc7-92e5-b56490026362", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:57:22.673160", "webstore_last_updated": null, "id": "0d667684-ab4b-44d1-91a3-a7f4a426ca5a", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Supporting Document", "mimetype": null, "cache_url": null, "name_fra": "Document connexe", "language": "eng; CAN", "created": "2013-06-03T11:40:35.154387", "url": "http://www.agr.gc.ca/atlas/supportdocument_documentdesupport/aafcWatersheds2012/en/", "webstore_url": null, "last_modified": null, "position": 2, "revision_id": "ce664261-f61f-43f7-be19-a756a016e554", "resource_type": "doc"}, {"resource_group_id": "1fa856f8-8bf0-4cc7-92e5-b56490026362", "cache_last_updated": null, "revision_timestamp": "2013-06-12T19:57:56.854652", "webstore_last_updated": null, "id": "3ba08ad1-b963-49ee-a7e8-e8928785a4c1", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Supporting Document", "mimetype": null, "cache_url": null, "name_fra": "Document connexe", "language": "fra; CAN", "created": "2013-06-03T13:42:11.705385", "url": "http://www.agr.gc.ca/atlas/supportdocument_documentdesupport/aafcWatersheds2012/fr/", "webstore_url": null, "last_modified": null, "position": 3, "revision_id": "7b456264-2013-4545-9060-f0e6947db8ce", "resource_type": "doc"}], "browse_graphic_url": "http://www.agr.gc.ca/atlas/supportdocument_documentdesupport/aafcWatersheds2012/aafcWatershed.jpg", "num_resources": 4, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Inland Waters  Eaux int\u00e9rieures", "Society  Soci\u00e9t\u00e9"], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Agriculture  Agriculture", "name": "Agriculture  Agriculture", "revision_timestamp": "2013-06-03T15:30:52.847039", "state": "active", "id": "6d82a7f3-c145-4795-aa97-af8044a0c05c"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Inland Waters  Eaux int\u00e9rieures", "name": "Inland Waters  Eaux int\u00e9rieures", "revision_timestamp": "2013-06-03T15:30:52.847039", "state": "active", "id": "f9e16051-8107-4259-befe-2a17ec28ddca"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-03T15:30:52.847039", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-03T15:30:52.847039", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Society  Soci\u00e9t\u00e9", "name": "Society  Soci\u00e9t\u00e9", "revision_timestamp": "2013-06-03T15:30:52.847039", "state": "active", "id": "2db63b8f-629c-448e-8035-b7f77da6ad54"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-03 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Bassin hydrologique,  hydrologie, eau, drainage, eaux int\u00e9rieures, provinces de l'Ouest ", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "79a52180-6cae-4b7c-bec1-96f02144a1ec", "revision_timestamp": "2013-06-03T15:45:18.498640", "metadata_modified": "2013-06-12T19:59:40.290535", "isopen": false, "date_modified": "2012-04-30 00:00:00", "url": "www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "AAFC Watershed Project \u2013 2012", "revision_id": "979dd1e6-637b-4cdd-9a33-8c076ae91665", "notes": "The Agriculture and Agri-Food Canada\u2019s (AAFC) Watersheds Project level series supplies a number of watershed and watershed related datasets for the Prairie Provinces.  The levels are greater or smaller assemblages of hydrometric areas, or the components defining them. \r\nThe Project is organized by the hydrometric gauging station which are sourced from Environment Canada, the United States and Canadian provinces. Additional stations were generated to address structural issues, like river confluences or lake inlets. Collectively, they are referred to as the gauging stations, or simply, the stations.\r\nThe drainage area that each station monitors, between itself and one or more of its upstream neighbours, is called an \u2018incremental gross drainage area\u2019. \r\nThe incremental gross drainage areas are collected into larger or smaller groupings based on size or defined interest to generate the various \u2018levels \u2019of the series. They include:\r\nBasins of varying size:\r\n1.\tMajor drainage systems (3): Arctic Ocean, Hudson Bay and Gulf of Mexico;\r\n2.\tMajor basins (23): associated with river or lake reaches;\r\n3.\tProject sub-basins (47): created specifically for the project;\r\n4.\tSub-basins (51): based on specific Environment Canada hydrometric gauging station locations;\r\n5.\tSub-sub-basins (311): based on specific Environment Canada hydrometric gauging station locations);\r\nIncremental drainage areas:\r\n6.\tIncremental gross drainage areas: one per gauging station.\r\nThe incremental gross drainage areas are further subdivided into portions that either contribute or do not contribute to drainage to an average runoff event. The portions that do contribute are called \u2018effective drainage\u2019 areas, while those that don\u2019t are called \u2018non-contributing\u2019. These generate the following levels: \r\n7.\tIncremental Effective drainage areas; and\r\n8.\tIncremental Non-contributing areas.\r\nTotal drainage areas:\r\n9.\tTotal gross drainage areas;\r\n10.\tTotal effective drainage areas; and\r\n11.\tTotal non-contributing areas; \r\nAnd when combined for the entire project, yields the:\r\n12.\tEffective Drainage Area.\r\nThe series also includes the components:\r\n13.\tThe gauging stations;\r\n14.\tThe collection of boundaries (lines) of the gross incremental drainage areas as well as the boundaries that separate contributing from non-contributing areas for an average runoff event; and\r\n15.\tA network of downstream-directed lines that connect the gauging stations.\r\nAll linework is derived from large scale topographic data.\r\nOne additional non-spatial dataset, a table of tallied values by gauging station, is provided:\r\n16.\tThe Project Gauging Station Table.\r\n\r\nThe Project area, designed for the Prairie Provinces, covers all of Alberta, Saskatchewan and Manitoba, and those portions of British Columbia, Northwest Territories, Nunavut, Ontario, and the United States that are required to complete the trans-border sections of the watersheds.\r\nSince 1975 the AAFC Watersheds Project has systematically collected and refined watershed boundaries for the Prairies. The result is the authoritative source for gross and effective drainage areas in the Prairie Provinces.  The initial 1:50,000 analog delineations were moved to their digital form in 1994. Since then, the delineations have increased in accuracy and extent, and the series levels have increased to 16 in number.\r\n", "department_number": 235}
