{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 5, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Paysages agricoles des Prairies", "keywords": "Erosion, Farmlands, Soil, Earth sciences, Terrestrial ecosystems, Land management, Resources management, Grasslands, Farms", "data_series_issue_identification": "", "ready_to_publish": true, "id": "af113c94-fb91-4c22-bd70-f81f0dff227d", "metadata_created": "2013-06-04T20:31:22.380050", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Prairies  Prairies"], "notes_fra": "Les ensembles de donn\u00e9es de la s\u00e9rie \u00ab Paysages agricoles des Prairies (PAP)\u00bb d\u00e9crivent les zones des portions agricoles des Prairies canadiennes qui pr\u00e9sentent des ressources en sols et en eau, des utilisations des terres et des pratiques agricoles similaires. Ces zones sont repr\u00e9sent\u00e9es sous forme de polygones vectoriels.\r\nSur la base d\u2019attributs choisis tir\u00e9s des P\u00e9do-paysages du Canada (PPC) et du Recensement de l\u2019agriculture de 1996, les Prairies ont \u00e9t\u00e9 divis\u00e9es en 13 (treize) classes ou groupes de pratiques agricoles, lesquels sont par ailleurs regroup\u00e9s en cinq (5) grands groupes de pratiques agricoles.\r\nLes attributs typiquement utilis\u00e9s pour d\u00e9finir les groupes de pratiques agricoles sont les suivants : proportion de p\u00e2turage, proportion de jach\u00e8re, diversit\u00e9 des cultures, taille des fermes, et niveau d\u2019intrants (produits chimiques et engrais).\r\nLes cinq (5) grands groupes ont \u00e9t\u00e9 con\u00e7us de mani\u00e8re \u00e0 ce que puissent \u00eatre mieux saisies les relations entre les groupes.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-124, 45], [-124, 61], [-90, 61], [-90, 45]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "830845f0-5df7-40cf-bbd4-8e4137001834", "cache_last_updated": null, "revision_timestamp": "2013-06-12T18:52:01.126172", "webstore_last_updated": null, "id": "6c0e9ad5-fae8-4361-a7c8-45cf63660bac", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-04T16:32:37.844513", "url": "http://www.agr.gc.ca/atlas/data_donnees/agr/prairieAgriculturalLandscapes/en/prairie_agricultural_landscapes.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "2a43bcb9-2d86-4554-8a43-e86f68b42d53", "resource_type": "file"}, {"resource_group_id": "830845f0-5df7-40cf-bbd4-8e4137001834", "cache_last_updated": null, "revision_timestamp": "2013-06-12T18:52:40.275746", "webstore_last_updated": null, "id": "4cc0bfdf-1599-4ebe-9224-3aed9f68cdd2", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-04T16:33:58.474445", "url": "http://www.agr.gc.ca/atlas/data_donnees/agr/prairieAgriculturalLandscapes/fr/groupesDePratiquesAgricolesDesPrairiesCanadiennes.zip", "webstore_url": null, "