": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "af113c94-fb91-4c22-bd70-f81f0dff227d", "revision_timestamp": "2013-06-06T15:09:23.848125", "metadata_modified": "2013-06-12T18:52:40.275746", "isopen": false, "date_modified": "1999-12-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Prairie Agricultural Landscapes", "revision_id": "55f6aca2-3b5f-4639-9279-7df3ff983db2", "notes": "The \u201cPrairie Agricultural Landscapes (PAL)\u201d datasets identify areas of the agricultural portions of the Canadian Prairies with similar land and water resources, land use and farming practices. They are represented by vector polygons.\r\nBased on selected attributes from the Soil Landscapes of Canada (SLC) and the 1996 Census of Agriculture, the Prairies were classified into 13 (thirteen) classes of Land Practices Group and five (5) Major Land Practices Groups.\r\nTypical attributes used to define the Land Practice Groups include: land in pasture, land in summerfallow, crop mixture, farm size and the level of chemical and fertilizer inputs.\r\nThe five (5) Major Groups were devised to help better understand the relationships between the groups.\r\n", "department_number": 235}
