{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Fichiers num\u00e9riques des limites des aires de diffusion - Recensement de 2006", "keywords": "census of population, dissemination area, geographic areas, geographic information systems, mapping, reference maps ", "data_series_issue_identification": "", "ready_to_publish": true, "id": "15b394fd-6e06-4a68-9b18-335002e15568", "metadata_created": "2013-06-03T01:18:27.333668", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "fichiers des limites", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les Fichiers des limites des aires de diffusion illustrent les limites des aires de diffusion pour lesquelles les donn\u00e9es du recensement sont diffus\u00e9es. On peut les t\u00e9l\u00e9charger dans deux types de fichiers : cartographiques et num\u00e9riques. Les fichiers des limites cartographiques repr\u00e9sentent les r\u00e9gions g\u00e9ographiques en se servant seulement de la masse terrestre principale du Canada et de ses \u00eeles c\u00f4ti\u00e8res. Les fichiers num\u00e9riques des limites repr\u00e9sentent la totalit\u00e9 du territoire, y compris les rives. Les fichiers fournissent un cadre de cartographie et d'analyse spatiale ax\u00e9 sur des syst\u00e8mes d'information g\u00e9ographique (SIG) ou sur d'autres logiciels de cartographie offerts sur le march\u00e9.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordi