published": "2013-05-17 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "SCHL", "groups": [], "organization": {"description": "", "title": "Canada Mortgage and Housing Corporation | Soci\u00e9t\u00e9 canadienne d'hypoth\u00e8ques et de logement", "created": "2013-05-14T09:17:39.238106", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:39.197960", "is_organization": true, "state": "active", "image_url": "", "revision_id": "5db65cbc-3015-4dba-9fc2-7b812137ef22", "type": "organization", "id": "05AFE8D4-BE53-4853-B529-A79C78757969", "name": "cmhc-schl"}, "data_series_name": "", "relationships_as_subject": [], "name": "da948165-5dd7-4366-b470-95617a9e2a56", "num_tags": 1, "metadata_modified": "2013-06-09T01:11:12.164297", "isopen": false, "url": "http://www.cmhc.ca/en/index.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "05AFE8D4-BE53-4853-B529-A79C78757969", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Canada Mortgage and Housing Corporation, absorptions and unabsorbed inventory, newly completed dwellings, by type of dwelling unit in census agglomerations of 50,000 and over", "revision_id": "3cb5c1d7-4769-4ad8-856a-08d46433645a", "notes": "Canada Mortgage and Housing Corporation, absorptions and unabsorbed inventory, newly completed dwellings, by type of dwelling unit in census agglomerations of 50,000 and over\r\n", "department_number": 87}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 9, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Cadre \u00e9cologique national pour le Canada ", "keywords": "Terrestrial ecosystems, Ecology, Ecosystems", "data_series_issue_identification": "", "ready_to_publish": true, "id": "4a63027e-f4af-4a82-84a3-7f81485c6629", "metadata_created": "2013-06-12T20:45:54.279068", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario  Ontario", "Territories  Territoires", "Prairies  Prairies", "Quebec  Qu\u00e9bec", "British Columbia  Colombie-Britannique", "Atlantic  Atlantique"], "notes_fra": "Le cadre \u00e9cologique national fourni un contexte spatial national coh\u00e9rent pour d\u00e9crire et surveiller l'\u00e9volution des \u00e9cosyst\u00e8mes \u00e0 divers niveaux de g\u00e9n\u00e9ralisation. L'utilisation d'unit\u00e9s \u00e9cologiques normalis\u00e9es facilite la communication et l'\u00e9change de rapports entre les divers gouvernements et les diverses disciplines, et il importait d'\u00e9tablir une base commune pour rendre compte de l'\u00e9tat de l'environnement et de la p\u00e9rennit\u00e9 des \u00e9cosyst\u00e8mes du Canada. \r\nLe Cadre \u00e9cologique national pour le Canada a \u00e9t\u00e9 \u00e9labor\u00e9 entre 1991 et 1999 par la Direction de science des \u00e9cosyst\u00e8mes d'Environnement Canada, et le Centre pour la terre et les ressources biologiques d'Agriculture et Agroalimentaire Canada. Plus de 100 organismes f\u00e9d\u00e9raux et provinciaux, des organisations non gouvernementales et entreprises du secteur priv\u00e9 ont contribu\u00e9s \u00e0 son d\u00e9veloppement. Une grande vari\u00e9t\u00e9 de produits sont disponibles ici et sur d'autres sites Web, comme indiqu\u00e9 ci-dessous.\r\n\r\nPoints-cl\u00e9s de la classification \u00e9cologique des terres:\r\n\u2022\tLa classification \u00e9cologique des terres prend en compte toutes les principales composantes des       \u00e9cosyst\u00e8mes : l'air, l'eau, les terres et les organismes vivants, dont les humains. \r\n\u2022\tElle proc\u00e8de d'une approche globale - la somme des constituantes est plus grande que le tout  qu'elles d\u00e9terminent.\r\n\u2022\tLe nombre et l'importance relative des facteurs permettant de d\u00e9limiter les unit\u00e9s \u00e9cologiques varient d'une r\u00e9gion \u00e0 l'autre, quel que soit le niveau de g\u00e9n\u00e9ralisation consid\u00e9r\u00e9. \r\n\u2022\tLa classification repose sur une hi\u00e9rarchie reconnaissant la pr\u00e9sence d'\u00e9cosyst\u00e8mes restreints dans d'autres \u00e9cosyst\u00e8mes plus vastes. Le cadre \u00e9cologique pour le Canada d\u00e9finit quatre niveaux d\u2019\u00e9cosyst\u00e8mes comme une hi\u00e9rarchie de domaines :\r\no\t\u00c9cozones\r\no\t\u00c9coprovinces\r\no\t\u00c9cor\u00e9gions\r\no\t\u00c9codistricts\r\n\u2022\tElle requiert l'int\u00e9gration des connaissances et ne se limite pas \u00e0 un simple processus de superposition. \r\n\u2022\tElle prend en compte le fait que les \u00e9cosyst\u00e8mes sont interactifs et que les caract\u00e9ristiques des \u00e9cosyst\u00e8mes se fondent avec celles des \u00e9cosyst\u00e8mes qui les entourent. \r\n\u2022\tLe syst\u00e8me de classification reconna\u00eet que les lignes cartographiques correspondent g\u00e9n\u00e9ralement \u00e0 l'emplacement des zones de transition. \r\nLe Cadre \u00e9cologique national pour le Canada se compose des ensembles de donn\u00e9es suivants :\r\n\u2022\tAltitude\r\n\u2022\tSuperficie totale des terres et plans d\u2019eau\r\n\u2022\tSuperficie des terres et plans d\u2019eau pour province / territoire\r\n\u2022\tCouverture v\u00e9g\u00e9tale\r\n\u2022\tForme de terrain\r\n\u2022\tPerg\u00e9lisol\r\n\u2022\tMat\u00e9riaux superficiels\r\n\u2022\tD\u00e9veloppement du sol\r\n\u2022\tTexture du sol\r\n\u2022\tMat\u00e9riaux de surface\r\n\u2022\tModel\u00e9 de surface\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "6896cb7a-6882-47a9-bead-b994b36a9cdb", "cache_last_updated": null, "revision_timestamp": "2013-06-12T20:47:29.927755", "webstore_last_updated": null, "id": "efe81f8c-c22e-4b05-a9d1-16e4e5759887", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-12T16:47:30.048158", "url": "http://www.agr.gc.ca/atlas/data_donnees/bio/aafcEcostratification/en/aafcEcostratification.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "b479ee24-0bcf-4ebe-889a-75a7b01c3577", "resource_type": "file"}, {"resource_group_id": "6896cb7a-6882-47a9-bead-b994b36a9cdb", "cache_last_updated": null, "revision_timestamp": "2013-06-12T20:48:16.077502", "webstore_last_updated": null, "id": "fd7434d1-1143-4ae6-bd35-bd25a9bd07a6", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-12T16:48: