nder the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Agriculture  Agriculture", "name": "Agriculture  Agriculture", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "6d82a7f3-c145-4795-aa97-af8044a0c05c"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Atlantic  Atlantique", "name": "Atlantic  Atlantique", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "c7ec122f-14b7-4447-aaeb-53def03d58c6"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "British Columbia  Colombie-Britannique", "name": "British Columbia  Colombie-Britannique", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "e756881c-4781-4f15-b03b-1bc0f6688665"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Ontario  Ontario", "name": "Ontario  Ontario", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "170ff7c8-314d-4801-853c-97c87b308aa9"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Quebec  Qu\u00e9bec", "name": "Quebec  Qu\u00e9bec", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "db38a71d-cc91-40b2-b3de-a893f2fc46be"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Territories  Territoires", "name": "Territories  Territoires", "revision_timestamp": "2013-06-12T20:45:54.279068", "state": "active", "id": "c6c59b71-ac42-4d28-a607-4a87aba661c7"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-12 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "\u00c9cosyst\u00e8me terrestre, \u00e9cologie, \u00e9cosyst\u00e8me", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "4a63027e-f4af-4a82-84a3-7f81485c6629", "revision_timestamp": "2013-06-12T20:50:07.291146", "metadata_modified": "2013-06-12T20:50:07.291146", "isopen": false, "date_modified": "1999-12-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "National Ecological Framework for Canada", "revision_id": "2889ea57-e026-45c9-8bb0-f69d13e2832c", "notes": "The National Ecological Framework for Canada provides a consistent, national spatial framework that allows various ecosystems to be described, monitored and reported on. It provides standard ecological units that allow different jurisdictions and disciplines to use common communication and reporting, and a common ground to report on the state of the environment and the sustainability of ecosystems in Canada.\r\nThe framework was developed between 1991 and 1999 by the Ecosystems Science Directorate, Environment Canada and the Center for Land and Biological Resources Research, Agriculture and Agri-Food Canada. Over 100 federal and provincial agencies, non-governmental organizations and private sector companies contributed to its development.\r\n\r\nKey Points in Ecological Land Classification:\r\n\u2022\tEcological Land Classification incorporates all major components of ecosystems: air, water, land, and biota, including humans. \r\n\u2022\tIt is holistic; \"the sum is greater than the whole\". \r\n\u2022\tThe number and relative importance of factors helpful in delineating ecological units varies from one area to another, regardless of the level of generalization. \r\n\u2022\tIt is based on a hierarchy with ecosystems nested within ecosystems. The Ecological Framework for Canada defines four levels of ecosystems as a nested hierarchy of areas:\r\no\tEcozones\r\no\tEcoprovinces\r\no\tEcoregions\r\no\tEcodistricts\r\n\u2022\tIt involves integration of knowledge and is not simply an overlay process. \r\n\u2022\tIt recognizes that ecosystems are interactive and that characteristics of one ecosystem blend with those of another. \r\n\u2022\tIt recognizes that map lines generally depict the location of zones of transition.\r\n\r\nThe National Ecological Framework for consists of the following datasets:\r\n\u2022\tElevation\r\n\u2022\tTotal Land and Water Area\r\n\u2022\tLand and Water Area by Province/Territory\r\n\u2022\tLand Cover\r\n\u2022\tLandform\r\n\u2022\tPermafrost\r\n\u2022\tSurficial Geology\r\n\u2022\tSoil Development\r\n\u2022\tSoil Texture\r\n\u2022\tSurface Material\r\n\u2022\tSurface Form\r\n", "department_number": 235}
