{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "revision_timestamp": "2013-06-01T17:34:37.966005", "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Fichiers des limites cartographiques des localit\u00e9s d\u00e9sign\u00e9es - Recensement de 2011", "keywords": "census of population, designated place, geographic areas, geographic information systems, mapping, reference maps", "data_series_issue_identification": "", "ready_to_publish": true, "id": "e1f5053f-958a-462f-bbe1-66c14f315731", "metadata_created": "2013-06-01T17:29:49.634022", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "fichiers des limites", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les Fichiers des limites des localit\u00e9s d\u00e9sign\u00e9es illustrent les limites des localit\u00e9s d\u00e9sign\u00e9es pour lesquelles les donn\u00e9es du recensement sont diffus\u00e9es. On peut les t\u00e9l\u00e9charger dans deux types de fichiers : cartographiques et num\u00e9riques. Les fichiers des limites cartographiques repr\u00e9sentent les r\u00e9gions g\u00e9ographiques en se servant seulement de la masse terrestre principale du Canada et de ses \u00eeles c\u00f4ti\u00e8res. Les fichiers num\u00e9riques des limites repr\u00e9sentent la totalit\u00e9 du territoire, y compris les rives. Les fichiers fournissent un cadre de cartographie et d'analyse spatiale ax\u00e9 sur des syst\u00e8mes d'information g\u00e9ographique (SIG) ou sur d'autres logiciels de cartographie offerts sur le march\u00e9.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map