, "name": "e1f5053f-958a-462f-bbe1-66c14f315731", "time_period_coverage_end": "2011-01-01 00:00:00", "num_tags": 2, "organization": {"description": "", "title": "Statistics Canada | Statistique Canada", "created": "2013-05-14T09:17:52.316230", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.272382", "is_organization": true, "state": "active", "image_url": "", "revision_id": "87fcd1c4-2bd0-4977-ab91-3622e73393e2", "type": "organization", "id": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "name": "statcan"}, "metadata_modified": "2013-06-01T17:34:37.966005", "isopen": false, "url": "http://www12.statcan.gc.ca/census-recensement/2011/geo/index-eng.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Designated Place Cartographic Boundary Files - 2011 Census", "revision_id": "323383f2-d0c7-4e11-bd76-ff4a47f0ec91", "notes": "The Designated Place Boundary Files portray the designated place boundaries for which census data are disseminated. They are available for download in two types: cartographic and digital. Cartographic boundary files depict the geographic areas using only the shorelines of the major land mass of Canada and its coastal islands. Digital boundary files depict the full extent of the geographic areas, including the coastal water area. The files provide a framework for mapping and spatial analysis using commercially available geographic information systems (GIS) or other mapping software.", "department_number": 256}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Base de donn\u00e9es en ligne des effets ind\u00e9sirables de Canada Vigilance - Version fran\u00e7aise", "keywords": "online database, suspected adverse reactions, drugs, health products, prescription, non-prescription medication, natural health products, radiopharmaceuticals, canada vigilance program, reports, submit, health professionals, consumers, market authorization holders, manufacturers, distributors, voluntary basis, mandatory reporting, adverse reaction reports, data extraction, ascii, data extract text files", "data_series_issue_identification": "", "id": "9cbaef00-b52c-4a70-9fed-d9aa8263ab74", "metadata_created": "2013-05-14T21:08:32.456092", "subject": ["Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Unknown | Inconnu", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "L'extrait des donn\u00e9es est une s\u00e9rie de fichiers ASCII compress\u00e9s des donn\u00e9es compl\u00e8tes contenues dans la Base de donn\u00e9es en ligne des effets ind\u00e9sirables de Canada Vigilance. Il est destin\u00e9 aux utilisateurs qui sont familiaris\u00e9s avec les structures de bases de donn\u00e9es et capables de cr\u00e9er leurs propres requ\u00eates.\r\n\r\nUne description d\u00e9taill\u00e9e de la structure de donn\u00e9es requise pour utiliser le fichier de donn\u00e9es se situe \u00e0 la page suivante : Base de donn\u00e9es en ligne des effets ind\u00e9sirables de Canada Vigilance - Structure des donn\u00e9es de la Base de donn\u00e9es des effets ind\u00e9sirables. Pour utiliser les donn\u00e9es, vous devez importer le fichier dans une base de donn\u00e9es ou un syst\u00e8me d'information existant.\r\n\r\nLa base de donn\u00e9es en ligne des effets ind\u00e9sirables de Canada Vigilance renferme de l'information au sujet des effets ind\u00e9sirables soup\u00e7onn\u00e9s (ou effets secondaires) associ\u00e9s \u00e0 des produits de sant\u00e9 qui a \u00e9t\u00e9 obtenue \u00e0 partir des d\u00e9clarations d'effets ind\u00e9sirables soumises \u00e0 Sant\u00e9 Canada par les consommateurs et les professionnels de la sant\u00e9, de fa\u00e7on volontaire, ainsi que par les d\u00e9tenteurs d'autorisation de mise en march\u00e9 (les fabricants et les distributeurs ) qui sont tenus de d\u00e9clarer les effets ind\u00e9sirables en vertu du R\u00e8glement sur les aliments et drogues. Les informations concernant les vaccins utilis\u00e9s pour immunisation sont inclus dans la base de donn\u00e9es que depuis le 1 janvier, 2011.\r\n\r\nNota : La base de donn\u00e9es ne peut \u00eatre utilis\u00e9e seule pour \u00e9valuer le profil d'innocuit\u00e9 d'un produit de sant\u00e9. Elle ne fournit pas d'information concluante sur l'innocuit\u00e9 des produits de sant\u00e9 et elle n'a pas pour objet de remplacer les avis m\u00e9dicaux. Si vous avez un probl\u00e8me d'ordre m\u00e9dical, veuillez consulter un professionnel de la sant\u00e9 qualifi\u00e9.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "b98cb535-ddee-4193-b19a-4dde79688ed0", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:08:32.456092", "webstore_last_updated": null, "id": "2e736909-ef1f-4d60-bfb6-f15b3be3b1fa", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-05-14T17:08:32.515611", "url": "http://www.hc-sc.gc.ca/dhp-mps/alt_formats/zip/medeff/databasdon/extract_extrait_2011-09-30.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "005f45c6-ee84-4cfd-8db0-dbcd9d0dcec8", "resource_type": "file"}, {"resource_group_id": "b98cb535-ddee-4193-b19a-4dde79688ed0", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:08:32.456092", "webstore_last_updated": null, "id": "1cdb4f3c-90aa-4b98-aefd-94e846d34255", "size": null, "state": "active", "hash": "", "description": "", "format": "SHAPE", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-05-14T17:08:32.515652", "url": "http://geodepot.statcan.gc.ca/2006/2009070518030114/01180309140615/040206/1401200915140112/030319-191821/07030319000010601_05-eng.zip", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "005f45c6-ee84-4cfd-8db0-dbcd9d0dcec8", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 2, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "revision_timestamp": "2013-05-14T21:08:32.456092", "state": "active", "id": "d6525956-d45a-41d8-bdeb-1a6c4a0c9a5f"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2009-02-12 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "base de donn\u00e9es en ligne, effets ind\u00e9sirables pr\u00e9sum\u00e9s, m\u00e9dicaments, produits de sant\u00e9, m\u00e9dicaments sur ordonnance, vente libre, produits de sant\u00e9 naturels, produits radiopharmaceutiques, programme canada vigilance, d\u00e9clarations, professionnels de la sant\u00e9, consommateurs, d\u00e9tenteurs d'une autorisation de mise en march\u00e9, fabricants,  distributeurs, base volontaires, d\u00e9claration obligatoire, effets ind\u00e9sirables, extrait des donn\u00e9es, fichiers, ascii", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "9cbaef00-b52c-4a70-9fed-d9aa8263ab74", "revision_timestamp": "2013-05-16T17:44:49.131556", "organization": {"description": "", "title": "Health Canada | Sant\u00e9 Canada", "created": "2013-05-14T09:17:51.376994", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:51.333174", "is_organization": true, "state": "active", "image_url": "", "revision_id": "94e225c6-b021-43c0-a7df-9beb7a7c1dae", "type": "organization", "id": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "name": "hc-sc"}, "metadata_modified": "2013-05-16T17:44:49.131556", "isopen": false, "url": "http://webprod3.hc-sc.gc.ca/arquery-rechercheei/index-eng.jsp", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "url_fra": "http://webprod3.hc-sc.gc.ca/arquery-rechercheei/language-langage.do?url=t.search.recherche&lang=fra", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Canada Vigilance Adverse Reaction Online Database", "revision_id": "827bddbd-88b3-4393-8e3a-c06f2e511e54", "notes": "The data extract is a series of compressed ASCII text files of the full data set contained in the Canada Vigilance Adverse Reaction Online Database. It is intended for users who are familiar with database structures and setting up their own queries.\r\n\r\nFind details on the data structure required for the data file in the Canada Vigilance Adverse Reaction Online Database - Data Structure. In order to use the data, the file must be loaded into an existing database or information system provided by the user.\r\n\r\nThe Canada Vigilance Adverse Reaction Online Database contains information about suspected adverse reactions (also known as side effects) to health products, captured from adverse reaction reports submitted to Health Canada by consumers and health professionals, who submit reports voluntarily, as well as by market authorization holders (manufacturers and distributors), who are required to submit reports according to the Food and Drugs Regulations. Information concerning vaccines used for immunization have only been included in the database since January 1, 2011.\r\n\r\nNote: The database cannot be used on its own to evaluate a health product's safety profile. It does not provide conclusive information on the safety of health products, and is not a substitute for medical advice. Should you have an issue of medical concern, consult a qualified health professional.", "department_number": 271}
