{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "La Classification Nationale des professions ", "keywords": "occupation, classification, jobs, labour market", "data_series_issue_identification": "", "ready_to_publish": true, "id": "9c74c5fc-e515-4075-9271-7037b7525607", "metadata_created": "2013-06-12T00:47:14.950022", "subject": ["Society and Culture  Soci\u00e9t\u00e9 et culture"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "La Classification Nationale des professions (CNP) est la r\u00e9f\u00e9rence reconnue des professions au Canada. Elle r\u00e9partie plus de 40 000 appellations d'emplois en 500 profils de groupes professionnels. La CNP est utilis\u00e9e quotidiennement par de milliers d'individus pour compiler, analyser et communiquer de l'information sur les professions et pour prendre connaissance des emplois \u00e0 l'\u00e9chelle du march\u00e9 du travail canadien.\r\n\r\nLa CNP constitue un cadre normalis\u00e9 pour organiser le monde du travail de mani\u00e8re coh\u00e9rente. Elle est utilis\u00e9e pour recueillir et organiser les statistiques sur les professions et pour fournir de l'information sur le march\u00e9 du travail. La structure et le contenu de la CNP sont \u00e9galement implant\u00e9s dans plusieurs services et produits de premier plan dans les secteurs priv\u00e9s et public.\r\n\r\nRessources humaines et D\u00e9veloppement des comp\u00e9tences Canada (RHDCC), en collaboration avec Statistique Canada (SC), font la mise \u00e0 jour de la CNP \u00e0 chaque cycle de recensement tous les 5 ans. La r\u00e9vision est bas\u00e9e sur des recherches et consultations approfondies des professions et men\u00e9es \u00e0 travers le pays, refl\u00e9tant l'\u00e9volution du march\u00e9 du travail canadien.\r\n\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "", "type": "dataset", "resources": [{"resource_group_id": "331eec9f-1723-47bb-8edc-95a5f054667a", "cache_last_updated": null, "revision_timestamp": "2013-06-13T15:21:47.153534", "webstore_last_updated": null, "id": "7a040bd6-700c-442d-a96f-8ba8c8b94e47", "size": null, "state": "active", "hash": "", "description": "", "format": "XML", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "NOC 2011", "mimetype": null, "cache_url": null, "name_fra": "CNP 2011", "language": "eng; CAN", "created": "2013-06-11T20:48:17.794173", "url": "http://www.rhdcc-hrsdc.gc.ca/ouvert-open/bca-seb/imt-lmi/20120130-01-noc2011-eng.xml", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "339947ee-eabe-46b6-a5b5-0333353dc2a6", "resource_type": "file"}, {"resource_group_id": "331eec9f-1723-47bb-8edc-95a5f054667a", "cache_last_updated": null, "revision_timestamp": "2013-06-13T15:23:39.890102", "webstore_last_updated": null, "id": "cb1bb2cf-3369-4339-a272-9ef4749ac2ee", "size": null, "state": "active", "hash": "", "description": "", "format": "XML", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "NOC 2011", "mimetype": null, "cache_url": null, "name_fra": "CNP 2011", "language": "fra; CAN", "created": "2013-06-11T20:48:55.425129", "url": "http://www.rhdcc-hrsdc.gc.ca/ouvert-open/bca-seb/imt-lmi/20120130-01-cnp2011-fra.xml", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "06a9250f-9910-4e5c-ab0d-6922fdb3ea77", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 2, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Society and Culture  Soci\u00e9t\u00e9 et culture", "name": "Society and Culture  Soci\u00e9t\u00e9 et culture", "revision_timestamp": "2013-06-12T00:47:14.950022", "state": "active", "id": "d1c465a8-9201-4975-9191-329c0e956645"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-01-31 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "professions, classification, emplois, march\u00e9 du travail", "groups": [], "organization": {"description": "", "title": "Human Resources and Skills Development Canada | Ressources humaines et D\u00e9veloppement des comp\u00e9tences Canada", "created": "2013-05-14T09:17:44.439612", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:44.396255", "is_organization": true, "state": "active", "image_url": "", "revision_id": "c74992f5-5f34-4679-bb40-3206f9e4cf41", "type": "organization", "id": "055ADCD8-8FDA-40DA-A5B7-689FF7DB57A6", "name": "hrsdc-rhdcc"}, "data_series_name": "", "relationships_as_subject": [], "name": "9c74c5fc-e515-4075-9271-7037b7525607", "revision_timestamp": "2013-06-12T00:49:12.751619", "metadata_modified": "2013-06-13T15:23:39.890102", "isopen": false, "url": "", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "055ADCD8-8FDA-40DA-A5B7-689FF7DB57A6", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "National Occupational Classification ", "revision_id": "054febda-1497-4a73-b167-9c06d86fd6f1", "notes": "The National Occupational Classification (NOC) is the nationally accepted reference on occupations in Canada. It organizes over 40,000 job titles into 500 occupational group descriptions. It is used daily by thousands of people to compile, analyze and communicate information about occupations, and to understand the jobs found throughout Canada's labour market. \r\n\r\nThe NOC provides a standardized framework for organizing the world of work in a coherent system. It is used to manage the collection and reporting of occupational statistics and to provide understandable labour market information. The structure and content of the NOC are also implemented in a number of major services and products throughout the private and public sectors.\r\n\r\nHuman Resources and Skills Development Canada (HRSDC), in partnership with Statistics Canada (STC), update the NOC according to 5-year Census cycles. Revisions are based on extensive occupational research and consultations conducted across the country, reflecting the evolution of the Canadian labour market. \r\n\r\n", "department_number": 141}
