{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Quantit\u00e9 d'eau de surface et transport des s\u00e9diments", "keywords": "water level, flow, discharge, hydrometric, hydrology, water quantity, sediment, oil sands, monitoring", "data_series_issue_identification": "", "ready_to_publish": true, "id": "20d3f285-c8f5-4847-8140-678b0eae55f8", "metadata_created": "2013-06-13T18:41:53.899267", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Continual | Continue", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Des donn\u00e9es sur le niveau d'eau et le d\u00e9bit  sont disponibles \u00e0 partir du r\u00e9seau hydrom\u00e9trique des Relev\u00e9s hydrologiques du Canada (RHC).  RHC est l'organisme national charg\u00e9 de recueillir, d'interpr\u00e9ter et de diffuser des donn\u00e9es et des renseignements normalis\u00e9s sur les ressources en eau au Canada. En partenariat avec les provinces, les territoires et d'autres organismes, la Division exploite plus de 2 500 stations de jaugeage hydrom\u00e9trique actives dans l'ensemble du pays, tient \u00e0 jour des archives de donn\u00e9es historiques de plus de 7 600 stations et offre un acc\u00e8s aux donn\u00e9es provisoires (sur le niveau d'eau et le d\u00e9bit) en temps quasi r\u00e9el dans plus de 1 700 emplacements au Canada.  \r\n\r\nDes activit\u00e9s de surveillance sont en cours pour recueillir des \u00e9chantillons de s\u00e9diments en suspension dans le cours inf\u00e9rieur de la rivi\u00e8re Athabasca.  Ces activit\u00e9s de surveillance comprennent la mesure des caract\u00e9ristiques physiques, des concentrations et des charges de s\u00e9diments recueillis \u00e0 l'aide des normes de la Division.  Les s\u00e9diments seront \u00e9galement recueillis \u00e0 l'aide d'une centrifugeuse \u00e0 \u00e9coulement continu, puis analys\u00e9s en laboratoire pour mesurer les variables relatives \u00e0 la qualit\u00e9 des s\u00e9diments, conform\u00e9ment \u00e0 l'annexe B du plan de surveillance int\u00e9gr\u00e9. Dans le cours inf\u00e9rieur de la rivi\u00e8re Athabasca, les mat\u00e9riaux du lit sont connus pour se d\u00e9placer et migrer en aval.  Afin de produire des cartes bathym\u00e9triques de la morphologie du chenal du lit au fil du temps, une surveillance est en cours. Elle permettra de d\u00e9terminer le transport des mat\u00e9riaux du lit en aval et sera \u00e9galement utile dans le cadre de l'\u00e9talonnage ou de la validation de mod\u00e8les de l'\u00e9rosion, du transport ou du d\u00e9p\u00f4t des s\u00e9diments ou du bitume.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Table Digital | Table num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-141.19780,81.79417], [-52.69078,81.79417], [-52.69078,42.02686], [-141.19780,42.02686], [-141.19780,81.79417]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=fr", "type": "dataset", "resources": [{"resource_group_id": "92d99140-6e1b-43d7-95ee-08b283a68d95", "cache_last_updated": null, "revision_timestamp": "2013-06-13T18:44:04.522622", "webstore_last_updated": null, "id": "1e4f8289-140f-42a8-8a57-9d37cb16adcf", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Historical hydrometric data", "mimetype": null, "cache_url": null, "name_fra": "Historical hydrometric data", "language": "eng; CAN | fra; CAN", "created": "2013-06-13T14:44:04.636729", "url": "ftp://arccf10.tor.ec.gc.ca/wsc/software/HYDAT/", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "14fb734e-b880-485d-aaf9-27919b8ecc61", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-13T18:41:53.899267", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T18:41:53.899267", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-12-18 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "niveau eau, \u00e9coulement, d\u00e9bit, hydrom\u00e9trique, hydrologie, quantit\u00e9 eau, s\u00e9diments, sables bitumineux, surveillance", "groups": [], "organization": {"description": "", "title": "Environment Canada | Environnement Canada", "created": "2013-05-14T09:17:41.395797", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.354936", "is_organization": true, "state": "active", "image_url": "", "revision_id": "18112ac5-2ef2-4519-ad05-a58dc9985d41", "type": "organization", "id": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "name": "ec"}, "data_series_name": "", "relationships_as_subject": [], "name": "20d3f285-c8f5-4847-8140-678b0eae55f8", "revision_timestamp": "2013-06-13T18:47:09.087903", "metadata_modified": "2013-06-13T18:47:09.087903", "isopen": false, "url": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=en", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Surface Water Quantity and Sediment Transport", "revision_id": "b283e704-2e1b-4fdd-8129-cdc2145f54fe", "notes": "Water level and discharge data are available from Water Survey of Canada\u2019s Hydrometric Network.  The Water Survey of Canada (WSC) is the national authority responsible for the collection, interpretation and dissemination of standardized water resource data and information in Canada.   In partnership with the provinces, territories and other agencies, WSC operates over 2500 active hydrometric gauges across the country, maintains an archive of historical information for over 7600 stations and provides access to near real-time (water level and stream flow) provisional data at over 1700 locations in Canada.  \r\nMonitoring activities are underway to collect suspended sediment samples in the Lower Athabasca River.  These monitoring activities include measurements of physical characteristics, concentrations and sediment loadings collected using Water Survey Canada standards.  Sediments will also be collected using a continuous flow centrifuge and analysed in the laboratory for sediment quality variables as per Appendix B in the Integrated Monitoring Plan.   The river bed sediments in the Lower Athabasca are known to shift and migrate downstream.  Monitoring to generate bathymetric maps of the bed-channel morphology over time ids underway and will allow for determination of bed sediment transport downstream, and will also be useful in calibration/validation of sediment/bitumen erosion/transport/deposition models", "department_number": 99}
