3:49:45.504290", "isopen": false, "url": "http://www.statcan.gc.ca/concepts/occupation-profession-eng.htm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "National Occupational Classification (NOC) 2011", "revision_id": "c560461e-4d9a-43ea-bf05-6569c39497d3", "notes": "The National Occupational Classification (NOC) 2011 updates both the National Occupational Classification 2006 of Human Resources and Skills Development Canada and Statistics Canada's National Occupational Classification for Statistics (NOC-S) 2006. This revised edition eliminates the differences between the two former systems. The first use of the NOC 2011 was in the 2011 National Household Survey.\r\n", "department_number": 256}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 8, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "P\u00e9do-paysages du Canada version 3.2", "keywords": "Earth sciences, Agriculture, Soil Taxonomy, Soil, Terrestrial ecosystems, Wetlands", "data_series_issue_identification": "", "ready_to_publish": true, "id": "86146b79-623e-4856-886b-0b03aa9b3f55", "metadata_created": "2013-06-11T22:26:39.142556", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario  Ontario", "Prairies  Prairies", "Atlantic  Atlantique", "Quebec  Qu\u00e9bec", "British Columbia  Colombie-Britannique"], "notes_fra": "L\u2019ensemble de donn\u00e9es \u00ab P\u00e9do-paysages du Canada (PPC) version 3.2 \u00bb fournit un ensemble de zones de sol g\u00e9o-r\u00e9f\u00e9renc\u00e9es (polygones) qui sont li\u00e9s aux donn\u00e9es d'attributs pr\u00e9sents dans la table des composantes (CMP), la table de classification des composantes (CRT), la table de nom de sol (SNT), la table de couche de sol (SLT), la table du segmentation du paysage (LST), la table des superficies du relief (LET), la table du cadre \u00e9cologique (EFT). Ensemble, ces ensembles de donn\u00e9es d\u00e9crivent la r\u00e9partition spatiale des sols et des paysages associ\u00e9s pour les r\u00e9gions agricoles du Canada. Cependant, certaines provinces (l'Alberta, la Nouvelle-\u00c9cosse et \u00e0 l'\u00cele-du-Prince-\u00c9douard) contiennent des donn\u00e9es CMP, SNT et SLT pour l'ensemble de la province (c\u2019est \u00e0 dire, au-del\u00e0 des zones agricoles). Cette version est compl\u00e9t\u00e9e par la version pr\u00e9c\u00e9dente des PPC (version 2.2), qui couvre l'ensemble du pays.\r\n\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "706301fa-1775-4db6-8821-0db389aa5457", "cache_last_updated": null, "revision_timestamp": "2013-06-12T17:48:09.619122", "webstore_last_updated": null, "id": "90da4520-38dc-4ce8-b3a0-89505fdbe936", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-11T18:27:14.537195", "url": "http://www.agr.gc.ca/atlas/data_donnees/geo/soilLandscapesOfCanada3_2/en/fgdb/soilLandscapesOfCanada3_2.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "e090e636-aeeb-4c89-9a21-08ad332dfcbd", "resource_type": "file"}, {"resource_group_id": "706301fa-1775-4db6-8821-0db389aa5457", "cache_last_updated": null, "revision_timestamp": "2013-06-12T17:48:58.255281", "webstore_last_updated": null, "id": "9eb5e540-c5ca-41cc-953e-ddb592356645", "size": null, "state": "active", "hash": "", "description": "", "format": "gml", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-11T18:27:42.898421", "url": "http://www.agr.gc.ca/atlas/data_donnees/geo/soilLandscapesOfCanada3_2/en/gml/soilLandscapesOfCanada3_2.zip", "webstore_url": null, "last_modified": null, "position": 1