", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "86146b79-623e-4856-886b-0b03aa9b3f55", "revision_timestamp": "2013-06-11T22:31:13.997881", "metadata_modified": "2013-06-12T17:56:02.087780", "isopen": false, "date_modified": "2011-03-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Soil Landscapes of Canada Version 3.2", "revision_id": "5b71799c-1fe7-4fbb-9191-d6fe0768ad8c", "notes": "The \u201cSoil Landscapes of Canada (SLC) Version 3.2\u201d dataset series provides a set of geo-referenced soil areas (polygons) that are linked to attribute data found in the associated Component Table (CMP), Component Rating Table (CRT), Soil Names Table (SNT), Soil Layer Table (SLT), Landscape Segmentation Table (LST), Landform Extent Table (LET), Landform Definition Table and Ecological Framework Table (EFT). Together, these datasets describe the spatial distribution of soils and associated landscapes for the agricultural areas of Canada. However, some provinces (Alberta, Nova Scotia, and Prince Edward Island) contain CMP, SNT and SLT data for the entire province (that is, beyond the agricultural areas). This version is complemented by the previous SLC version 2.2, which covers the entire country.\r\n", "department_number": 235}
