{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 12, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "LISTE MA\u00ceTRESSE DES DROITS EN VIGUEUR \u00c0 PARCS CANADA", "keywords": "Fees, Services, Facilities, Products, Rights, Privileges", "data_series_issue_identification": "", "ready_to_publish": true, "id": "63e3ba45-010f-404a-a825-783b0aebdba4", "metadata_created": "2013-06-11T15:49:56.181600", "subject": ["Information and Communications  Information et communication", "Society and Culture  Soci\u00e9t\u00e9 et culture", "History and Archaeology  Histoire et arch\u00e9ologie"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Quebec  Qu\u00e9bec", "Ontario  Ontario", "Alberta - Division No. 9  Alberta - Division No. 9", "Atlantic  Atlantique", "Prairies  Prairies", "British Columbia  Colombie-Britannique", "Territories  Territoires"], "notes_fra": "Cette liste ma\u00eetresse contient les droits pour les services, les installations, les produits, les permis et les privil\u00e8ges ainsi que les frais pour les organisateurs de voyages exig\u00e9s \u00e0 partir du 9 juillet 2010.\r\n\r\nCes frais d\u2019utilisation ont \u00e9t\u00e9 fix\u00e9s en vertu de la Loi sur les frais d\u2019utilisation sous l\u2019autorit\u00e9 de la Loi sur l\u2019Agence Parcs Canada. Ils s\u2019appliquent \u00e0 tous les parcs nationaux, les lieux historiques nationaux ainsi que les aires marines nationales de conservation administr\u00e9s par Parcs Canada. \u00c9galement inclus sont les frais qui ont \u00e9t\u00e9 ou seront discontinu\u00e9s.\r\n\r\nAfin de faciliter la consultation, les droits figurent par ordre