{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "L'inventaire national des monuments comm\u00e9moratifs militaires canadiens", "keywords": "heritage, memorials", "data_series_issue_identification": "", "ready_to_publish": true, "id": "8c9de07b-9ae0-41df-9895-6bb6d2f804ed", "metadata_created": "2013-05-14T13:56:58.164423", "subject": ["Military  Histoire et science militaire"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Quarterly | Trimestriel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "        Les Canadiens et les Canadiennes ont depuis longtemps servi leur pays en participant \u00e0 plusieurs guerres et conflits. Au fil des ann\u00e9es, des citoyens, des organisations d'anciens combattants et des clubs philanthropiques ont \u00e9rig\u00e9 des milliers de m\u00e9moriaux d'un bout \u00e0 l'autre du pays pour rendre hommage aux soldats, aux marins et aux aviateurs, ainsi qu'aux femmes, qui ont fait d'\u00e9normes sacrifices pour r\u00e9tablir la paix dans le monde et ont ainsi fait honneur \u00e0 leur pays.\r\n\r\n        Fid\u00e8les \u00e0 leur fier h\u00e9ritage, les Canadiens et les Canadiennes ont \u00e9rig\u00e9 des c\u00e9notaphes dans les centres municipaux, ainsi que des monuments dans les parcs, dans les cimeti\u00e8res et dans d'autres lieux publics. Des paroissiens ont mont\u00e9 des plaques comm\u00e9moratives et des vitraux dans leurs \u00e9glises et on a construit des tumulus et fontaines pour rappeler une vari\u00e9t\u00e9 d'\u00e9v\u00e9nements militaires importants. Tout cela dans le but de souligner le service de parents, d'ami(e)s et de camarades et d'assurer que ces batailles et ces \u00e9v\u00e9nements importants, souvent mal connus, restent grav\u00e9s dans notre m\u00e9moire collective.\r\n      ", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_id": "ca-ogl-lgo", "url_fra": "http://www.cmp-cpm.forces.gc.ca/dhh-dhp/nic-inm/index-fra.asp", "type": "dataset", "resources": [{"resource_group_id": "4d1904a5-55d4-4516-a107-d60c4de04e32", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:09:26.656264", "webstore_last_updated": null, "id": "3323e48f-0a5b-4fcf-b7cd-86062e227679", "size": null, "state": "active", "hash": "", "description": "", "format": "XML", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN | fra; CAN", "created": "2013-05-14T17:09:26.922955", "url": "http://www.cmp-cpm.forces.gc.ca/dhh-dhp/data/National_Inventory_of_Canadian_Military_Memorials_20120320.xml", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "1d57b006-96fd-4799-b3d6-abb74fbb4866", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Military  Histoire et science militaire", "name": "Military  Histoire et science militaire", "revision_timestamp": "2013-05-14T13:56:58.164423", "state": "active", "id": "776bc60a-464a-4a53-a32c-c6f11fd514d2"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2012-03-20 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "h\u00e9ritage, comm\u00e9moratifs", "groups": [], "organization": {"description": "", "title": "National Defence | D\u00e9fense nationale", "created": "2013-05-14T09:17:41.226341", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.186647", "is_organization": true, "state": "active", "image_url": "", "revision_id": "9aacd2f3-e6a3-4a17-b494-a13037e48d5c", "type": "organization", "id": "4CAEC647-C069-4C25-B1CD-17F648E5DBC0", "name": "dnd-mdn"}, "data_series_name": "", "relationships_as_subject": [], "name": "8c9de07b-9ae0-41df-9895-6bb6d2f804ed", "revision_timestamp": "2013-06-07T15:56:50.827115", "metadata_modified": "2013-06-07T15:57:24.170261", "isopen": false, "date_modified": "2012-03-20 00:00:00", "url": "http://www.cmp-cpm.forces.gc.ca/dhh-dhp/nic-inm/index-eng.asp", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "4CAEC647-C069-4C25-B1CD-17F648E5DBC0", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "National Inventory of Canadian Military Memorials", "revision_id": "bd24273b-038e-40b2-9edb-73256645e74e", "notes": "        Canadians have long served their country by participating in numerous wars and conflicts. Over the years, individual citizens, veterans organizations and service clubs have raised thousands of memorials across the country to honour those sailors, soldiers, airmen and women who made great sacrifices towards the restoration of world peace and served their country so well.\r\n\r\n        In keeping with our proud military heritage, Canadians erected cenotaphs in municipal centres, raised monuments in parks, cemeteries and public areas. Church members have mounted plaques and stained glass windows as memorials, and cairns and fountains have been constructed as important landmarks marking various military involvement. All of this is done to mark the service of family, friends and comrades, and to ensure that these important and not so well known battles and events form part of our communal memory.\r\n      ", "department_number": 32}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 10, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Programme national d\u2019analyse et de rapport en mati\u00e8re de sant\u00e9 agroenvironnementale (PNARSA) \u2013 Indicateurs agroenvironnementaux ", "keywords": "Environment, Earth sciences, Climate indicators", "data_series_issue_identification": "", "ready_to_publish": true, "id": "781f8781-f03a-43c5-9075-300b9d31308f", "metadata_created": "2013-06-04T19:43:15.102040", "subject": ["Agriculture  Agriculture", "Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Ontario  Ontario", "Prairies  Prairies", "Quebec  Qu\u00e9bec", "Atlantic  Atlantique", "British Columbia  Colombie-Britannique"], "notes_fra": "La s\u00e9rie de jeux de donn\u00e9es du Programme national d\u2019analyse et de rapport en mati\u00e8re de sant\u00e9 agroenvironnementale (PNARSA) fournit des donn\u00e9es sous la forme d\u2019indicateurs qui \u00e9valuent l\u2019impact environnemental des activit\u00e9s agricoles. Ces indicateurs agroenvironnementaux int\u00e8grent des donn\u00e9es sur les sols, le climat et les entit\u00e9s de la surface terrestre et des statistiques sur l\u2019utilisation des terres et les pratiques de gestion des cultures et des animaux d\u2019\u00e9levage. Les jeux de donn\u00e9es offrent de l\u2019information pr\u00e9cieuse, propre \u00e0 chaque site, sur l\u2019ensemble des conditions et risques environnementaux en agriculture au Canada et leur \u00e9volution au fil du temps.  \r\nLa s\u00e9rie de jeux de donn\u00e9es regroupe les donn\u00e9es du PNARSA qui sont li\u00e9es \u00e0 des caract\u00e9ristiques g\u00e9ographiques et qui peuvent \u00eatre repr\u00e9sent\u00e9es sur une carte. Elle n\u2019inclut pas les autres types de donn\u00e9es du PNARSA.\r\nLes jeux de donn\u00e9es se rangent dans les grands groupes suivants : \r\n\u2022\tGestion des terres agricoles\r\n\u2022\tSant\u00e9 des sols\r\n\u2022\tQualit\u00e9 de l\u2019eau\r\n\u2022\tQualit\u00e9 de l\u2019air\r\n\u2022\tIndustrie des aliments et des boissons (non inclus)\r\nJeux de donn\u00e9es sur la gestion des terres agricoles :\r\n\u2022\tCouverture des sols\r\n\u2022\tHabitat faunique\r\n\u2022\tGestion des terres agricoles (non inclus)\r\nJeux de donn\u00e9es sur la sant\u00e9 des sols :\r\n\u2022\t\u00c9rosion du sol\r\n\u2022\tMati\u00e8re organique du sol\r\n\u2022\t\u00c9l\u00e9ments traces\r\n\u2022\tSalinit\u00e9 du sol\r\nJeux de donn\u00e9es sur la qualit\u00e9 de l\u2019eau :\r\n\u2022\tAzote\r\n\u2022\tPhosphore\r\n\u2022\tColiformes\r\n\u2022\tPesticides\r\nJeux de donn\u00e9es sur la qualit\u00e9 de l\u2019air :\r\n\u2022\tGaz \u00e0 effet de serre\r\n\u2022\tAmmoniac\r\n\u2022\tParticules en suspension\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "713b53b1-fa49-478e-a265-cc7bec9e162d", "cache_last_updated": null, "revision_timestamp": "2013-06-12T18:54:43.854007", "webstore_last_updated": null, "id": "bdb4e234-12a9-41fc-a27b-b4cae28d9bf1", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CA