nt", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Ontario  Ontario", "name": "Ontario  Ontario", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "170ff7c8-314d-4801-853c-97c87b308aa9"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Quebec  Qu\u00e9bec", "name": "Quebec  Qu\u00e9bec", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "db38a71d-cc91-40b2-b3de-a893f2fc46be"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Transportation  Transport", "name": "Transportation  Transport", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "a7e3b9c3-a0b0-4d5d-99f1-2524b1d473fd"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Utilities Communication  Services communication", "name": "Utilities Communication  Services communication", "revision_timestamp": "2013-06-04T19:43:15.102040", "state": "active", "id": "93de460b-d1d5-4f7f-bdf8-cbd1c58d592a"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-04 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Environnement, sciences de la Terre, Indicateurs climatiques ", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "781f8781-f03a-43c5-9075-300b9d31308f", "revision_timestamp": "2013-06-06T14:31:57.409132", "metadata_modified": "2013-06-12T18:58:38.369757", "isopen": false, "date_modified": "2010-12-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "National Agri-Environmental Health Analysis and Reporting Program (NAHARP) \u2013 Agri-Environmental Indicators", "revision_id": "c85530c9-6c44-455f-9c16-413cd4031aa0", "notes": "National Agri-Environmental Health Analysis and Reporting Program (NAHARP) dataset series provides information that was created using indicators that assess the environmental impact of agricultural activities. These agri-environmental indicators integrate information on soils, climate and land surface features with statistics on land use and crop and livestock management practices. The datasets provide valuable, location-specific information on the overall environmental risks and conditions in agriculture across Canada and how these change over time.\r\nThis dataset series collects NAHARP data that is related to geographic features and can be represented on a map. Other types of NAHARP data are not included.\r\nThe datasets can be organized into the following major groups:\r\n\u2022\tFarm land management\r\n\u2022\tSoil health\r\n\u2022\tWater quality\r\n\u2022\tAir quality\r\n\u2022\tFood and beverage industry (not included)\r\nFarm land management datasets:\r\n\u2022\tSoil cover\r\n\u2022\tWildlife habitat\r\n\u2022\tFarm land management (not included)\r\nSoil health datasets:\r\n\u2022\tSoil erosion\r\n\u2022\tSoil organic matter\r\n\u2022\tTrace elements\r\n\u2022\tSoil salinity\r\nWater quality datasets:\r\n\u2022\tNitrogen\r\n\u2022\tPhosphorus\r\n\u2022\tColiforms\r\n\u2022\tPesticides\r\nAir quality datasets:\r\n\u2022\tGreenhouse Gases\r\n\u2022\tAmmonia\r\n\u2022\tParticulate Matter\r\n", "department_number": 235}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "revision_timestamp": "2013-06-01T17:27:57.804534", "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Fichiers des limites cartographiques des secteurs de recensement - Recensement de 2011", "keywords": "census of population, census tract, geographic areas, geographic information systems, mapping, reference maps", "data_series_issue_identification": "", "ready_to_publish": true, "id": "3c10c922-3eb4-48ba-b00f-a95c09ca3ee0", "metadata_created": "2013-06-01T17:23:16.446912", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "fichiers des limites", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les Fichiers des limites des secteurs de recensement illustrent les limites des secteurs de recensement pour lesquels les donn\u00e9es du recensement sont diffus\u00e9es. On peut les t\u00e9l\u00e9charger dans deux types de fichiers : cartographiques et num\u00e9riques. Les fichiers des limites cartographiques repr\u00e9sentent les r\u00e9gions g\u00e9ographiques en se servant seulement de la masse terrestre principale du Canada et de ses \u00eeles c\u00f4ti\u00e8res. Les fichiers num\u00e9riques des limites repr\u00e9sentent la totalit\u00e9 du territoire, y compris les rives. Les fichiers fournissent un cadre de cartographie et d'analyse spatiale ax\u00e9 sur des syst\u00e8mes d'information g\u00e9ographique (SIG) ou sur d'autres logiciels de cartographie offerts sur le march\u00e9.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spat