0", "time_period_coverage_end": "2011-01-01 00:00:00", "num_tags": 2, "organization": {"description": "", "title": "Statistics Canada | Statistique Canada", "created": "2013-05-14T09:17:52.316230", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:52.272382", "is_organization": true, "state": "active", "image_url": "", "revision_id": "87fcd1c4-2bd0-4977-ab91-3622e73393e2", "type": "organization", "id": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "name": "statcan"}, "metadata_modified": "2013-06-01T17:27:57.804534", "isopen": false, "url": "http://www12.statcan.gc.ca/census-recensement/2011/geo/index-eng.cfm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "A0F0FCFC-BC3B-4696-8B6D-E7E411D55BAC", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Census Tract Cartographic Boundary Files - 2011 Census", "revision_id": "693c2911-1d8f-481e-bc05-8a9279ebc704", "notes": "The Census Tract Boundary Files portray the census tract boundaries for which census data are disseminated. They are available for download in two types: cartographic and digital. Cartographic boundary files depict the geographic areas using only the shorelines of the major land mass of Canada and its coastal islands. Digital boundary files depict the full extent of the geographic areas, including the coastal water area. The files provide a framework for mapping and spatial analysis using commercially available geographic information systems (GIS) or other mapping software.", "department_number": 256}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Base de donn\u00e9es sur les r\u00e9sultats des initiatives horizontales", "keywords": "Horizontial Initiatives, expenditures, spending, results, programs, outcomes", "data_series_issue_identification": "", "id": "880f9bbe-0234-411c-a68c-259edf09f869", "metadata_created": "2013-06-13T20:47:46.960968", "subject": ["Government and Politics  Gouvernement et vie politique"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Annually | Annuel", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "La base de donn\u00e9es fournit des renseignements sur les ressources financi\u00e8res et non financi\u00e8res pr\u00e9vues et r\u00e9elles en fonction des initiatives horizontales. Des d\u00e9tails sont offerts sur chaque initiative, notamment le minist\u00e8re responsable, la dur\u00e9e de l\u2019initiative, le montant total des fonds affect\u00e9s, une description de l\u2019initiative, les r\u00e9sultats partag\u00e9s, la structure de gouvernance, les partenaires et les coordonn\u00e9es d\u2019une personne-ressource. Les plans, les d\u00e9penses et les r\u00e9sultats sont \u00e9galement disponibles pour chaque p\u00e9riode vis\u00e9e. Ces donn\u00e9es sont disponibles pour les trois ann\u00e9es suivantes: 2011-2012, 20101-2011, et 2009-2010", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "b46cfc34-d966-40de-8f1f-27fd15de18d8", "cache_last_updated": null, "revision_timestamp"