tions-Exportations,Agriculture Canada,Agriculture et Agroalimentaire,AAC en direct", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "f51fdc64-7a8a-4229-9208-7af07a7b0495", "revision_timestamp": "2013-06-13T14:33:19.304091", "metadata_modified": "2013-06-13T14:33:19.304091", "isopen": false, "url": "http://www.agr.gc.ca/redmeat/index_eng.htm", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Annual Red Meat Export/Import Report - Prior Year Comparison Exports 2008 Beef, Bison, Goat, Horsemeat, Lamb, Mutton, Pork, Veal", "revision_id": "1911e55d-6921-48c6-9eb4-4a2d57c9872d", "notes": "Report displays monthly exports/imports of selected red meat products, with a prior year comparison, for a selected year. Data is updated weekly and exports lag a minimum of 4 weeks. Excludes exports to the US. Revisions are continuous.", "department_number": 235}
{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 3, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Agriculture et Agroalimentaire Canada \u2013 Programme de p\u00e2turages communautaires", "keywords": "Grasslands, Western provinces, Rangeland, Pasture, Farm structures", "data_series_issue_identification": "", "ready_to_publish": true, "id": "4c90e70b-2f34-46e9-b87e-4c42c7c5837d", "metadata_created": "2013-06-04T15:26:28.030428", "subject": ["Agriculture  Agriculture"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Prairies  Prairies"], "notes_fra": "La s\u00e9rie de donn\u00e9es g\u00e9ographiques au niveau du Programme de p\u00e2turages communautaires d\u2019Agriculture et Agroalimentaire Canada (AAC) contient une collection abondante d\u2019ensembles de donn\u00e9es sur le programme et la gestion des installations pour ce programme d\u2019AAC r\u00e9alis\u00e9 dans les Prairies. Les donn\u00e9es mises \u00e0 jour annuellement refl\u00e8tent l\u2019\u00e9tat le plus courant des divers composants des p\u00e2turages. L\u2019\u00e9l\u00e9ment central de ces donn\u00e9es est repr\u00e9sent\u00e9 par le champ (enclos), qui est d\u00e9limit\u00e9 par ses cl\u00f4tures et qui constitue la base des p\u00e2turages.\r\nLes th\u00e8mes de donn\u00e9es comprennent ce qui suit :\r\nL\u2019ensemble des donn\u00e9es de base :\r\n\u2022\tCl\u00f4tures\r\nLes ensembles de donn\u00e9es d\u00e9riv\u00e9s :\r\n\u2022\tChamps\r\n\u2022\tContour des p\u00e2turages\r\nLes th\u00e8mes connexes des ressources et de gestion des installations : \r\n\u2022\tCorrals\r\n\u2022\tBarrages\r\n\u2022\tMares-r\u00e9servoirs\r\n\u2022\tCoupe feu\r\n\u2022\tR\u00e9servoirs de carburant\r\n\u2022\tBarri\u00e8res\r\n\u2022\tB\u00e2timents principaux du p\u00e2turage\r\n\u2022\tEsp\u00e8ces envahissantes (lignes, points et polygones)\r\n\u2022\tPoints d\u2019int\u00e9r\u00eat divers. Exemples : signalisation (pancartes), stations de pompage, amas de pierres, ponceaux, gravi\u00e8res et support \u00e0 faucon (support pour nid).\r\n\u2022\tConduites d\u2019eau\r\n\u2022\tSentiers d\u2019acc\u00e8s\r\n\u2022\tSites de d\u00e9chets solides\r\n\u2022\tRuisseaux\r\n\u2022\tAuges\r\n\u2022\tServices publics\r\n\u2022\tHerbes cultiv\u00e9es\r\n\u2022\tSites d\u2019eaux us\u00e9es\r\n\u2022\tPuits\r\n\u2022\tMoulins \u00e0 vent\r\nPresque tout le dessin au trait a \u00e9t\u00e9 g\u00e9n\u00e9r\u00e9 \u00e0 l\u2019aide de donn\u00e9es GPS recueillies par le personnel sur le terrain, ou \u00e0 l\u2019aide de donn\u00e9es num\u00e9ris\u00e9es \u00e0 partir d\u2019orthophotographies (photos a\u00e9riennes qui ont \u00e9t\u00e9 g\u00e9om\u00e9triquement corrig\u00e9es). Seuls les th\u00e8mes \u00ab esp\u00e8ces envahissantes \u00bb et \u00ab herbes cultiv\u00e9es \u00bb ont \u00e9t\u00e9 recueillis par relev\u00e9s GPS. \r\nLes ensembles de donn\u00e9es num\u00e9riques ont \u00e9t\u00e9 assembl\u00e9s depuis le d\u00e9but des ann\u00e9es 1990, et au fil des ans, leur niveau de d\u00e9tail et de pr\u00e9cision et le nombre de th\u00e8mes se sont accrus.\r\nLes ensembles de donn\u00e9es sont assembl\u00e9s pour cr\u00e9er des plans de localisation des p\u00e2turages individuels, lesquels servent \u00e0 cr\u00e9er des rapports annuels sur l\u2019utilisation des p\u00e2turages. Ces rapports aident les gestionnaires des p\u00e2turages \u00e0 g\u00e9rer leur b\u00e9tail et leurs ressources en p\u00e2turages sur une base quotidienne et annuelle.\r\nDans le cadre du programme, 910 000 hectares (2 250 000 acres) de terres marginales sont g\u00e9r\u00e9s en 85 p\u00e2turages (2012) dans les trois provinces des Prairies, \u00e0 savoir le Manitoba, la Saskatchewan et l\u2019Alberta. \r\n", "digital_object_identifier": "", "state": "deleted", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-124, 45], [-124, 61], [-90, 61], [-90, 45]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "881bbd23-4463-42de-8eea-48c8f1c15686", "cache_last_updated": null, "revision_timestamp": "2013-06-12T18:43:26.324969", "webstore_last_updated": null, "id": "a222c62b-461d-46e3-8098-ce9132abb880", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-04T11:28:03.437018", "url": "http://www.agr.gc.ca/atlas/data_donnees/agr/aafcCommunityPasturesProgram/en/aafcCommunityPastureProgram.zip", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "0d7688c9-1ee9-44f0-ba71-d7ae4987a201", "resource_type": "file"}, {"resource_group_id": "881bbd23-4463-42de-8eea-48c8f1c15686", "cache_last_updated": null, "revision_timestamp": "2013-06-12T18:44:06.126630", "webstore_last_updated": null, "id": "a85032fd-8835-4b77-87ad-9ef2d1d96324", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "fra; CAN", "created": "2013-06-04T11:29:55.604283", "url": "http://www.agr.gc.ca/atlas/data_donnees/agr/aafcCommunityPasturesProgram/fr/aacProgrammeDePaturagesCommunautaires.zip", "webstore_url": null, "last_modified": null, "position": 1, "revision_id": "d387ed79-0a05-4388-8f0e-da28ddd