me": "Agriculture  Agriculture", "revision_timestamp": "2013-06-04T15:26:28.030428", "state": "active", "id": "6d82a7f3-c145-4795-aa97-af8044a0c05c"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Farming  Agriculture", "name": "Farming  Agriculture", "revision_timestamp": "2013-06-04T15:26:28.030428", "state": "active", "id": "45aef9e7-a671-45e6-ab70-ec51da90269a"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-04T15:26:28.030428", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-04 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Prairies, provinces de lOuest, Parcours naturel, p\u00e2turage, structures agricoles", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "4c90e70b-2f34-46e9-b87e-4c42c7c5837d", "revision_timestamp": "2013-06-14T18:14:11.332055", "metadata_modified": "2013-06-14T18:14:11.332055", "isopen": false, "date_modified": "2013-04-30 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Agriculture and Agri-food Canada - Community Pastures Program", "revision_id": "8a7014d5-32a4-4274-a6e6-1ed0542c942a", "notes": "The Agriculture and Agri-Food Canada\u2019s (AAFC) Community Pastures Program level geographic data series supplies an extensive collection of program and facilities management datasets for the Prairie-based AAFC Community Pasture Program. The annually updated data reflect the most-current state of the pastures\u2019 components. The central focus is their fields (or paddocks), which are generated from their fences and by which the pastures are organized.  \r\nThe data themes include:\r\nThe foundational dataset:\r\n\u2022\tFences\r\nDerived datasets:\r\n\u2022\tFields\r\n\u2022\tPasture Outlines\r\nRelated facilities management and resource themes:  \r\n\u2022\tCorrals\r\n\u2022\tDams\r\n\u2022\tDugouts\r\n\u2022\tFire guards\r\n\u2022\tFuel tanks\r\n\u2022\tGates\r\n\u2022\tPasture headquarters\r\n\u2022\tInvasive species (line, point & polygon)\r\n\u2022\tMiscellaneous points of interest. Examples include: sign (signage), pump house, rock pile, culvert, gravel pit, and hawk stand (stand for nest).\r\n\u2022\tWater pipelines\r\n\u2022\tAccess trails\r\n\u2022\tSolid waste sites\r\n\u2022\tSprings\r\n\u2022\tTroughs\r\n\u2022\tUtilities\r\n\u2022\tTame grasses\r\n\u2022\tWaste water sites \r\n\u2022\tWells\r\n\u2022\tWindmills \r\nAlmost all linework is generated from either GPS data collected by field personnel, or digitized from orthophotos (aerial photos that have been geometrically corrected). Only the \u2018invasive species\u2019 and \u2018tame grasses\u2019 themes are collected by survey using GPS. \r\nThe digital datasets have been assembled since the early 1990s, and over the years have increased in detail, accuracy and number of themes.\r\nThe datasets are assembled for the creation of individual pasture location plans that are, in turn, used to create annual pasture utilization reports. The reports assist pasture managers in their year-to-year and day-to-day management of their cattle and pasture resources.\r\nIn the Program, 910,000 hectares (2,250,000 acres) of marginal land is managed in 85 pastures (2012) that are distributed across the prairie provinces of Manitoba, Saskatchewan and Alberta.  \r\n", "department_number": 235}
