{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 11, "data_series_issue_identification_fra": "", "catalog_type": "Geo Data | G\u00e9o", "license_title": "Open Government Licence - Canada", "title_fra": "Lev\u00e9s p\u00e9dologiques d\u00e9taill\u00e9s", "keywords": "Earth sciences, Agriculture, Soil Taxonomy, Soil, Terrestrial ecosystems, Wetlands", "data_series_issue_identification": "", "ready_to_publish": true, "id": "7ed13bbe-fbac-417c-a942-ea2b3add1748", "metadata_created": "2013-06-14T17:38:03.377865", "subject": ["Nature and Environment  Nature et environnement", "Agriculture  Agriculture"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "Unknown | Inconnu", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": ["Quebec  Qu\u00e9bec", "Ontario  Ontario", "Territories  Territoires", "Atlantic  Atlantique", "Prairies  Prairies", "British Columbia  Colombie-Britannique"], "notes_fra": "Un lev\u00e9 p\u00e9dologique est un inventaire des sols et de leur r\u00e9partition spatiale dans un paysage. Les rapports de lev\u00e9s p\u00e9dologiques comportent deux parties. La premi\u00e8re partie comprend une carte p\u00e9dologique ou une s\u00e9rie de cartes \u00e0 une \u00e9chelle particuli\u00e8re pr\u00e9sentant le codage de chacun des sols. Les rapports de lev\u00e9s p\u00e9dologiques comprennent \u00e9galement un document d'appui contenant de l'information de base, notamment sur la m\u00e9thode d'ex\u00e9cution du lev\u00e9, ainsi qu'une explication des crit\u00e8res d'interpr\u00e9tation et un sommaire de la superficie occup\u00e9e par divers types de sols.\r\n\r\nLes lev\u00e9s p\u00e9dologiques d\u00e9taill\u00e9s repr\u00e9sentent plus pr\u00e9cis\u00e9ment la variation des types de sols dans des paysages moins \u00e9tendus, comparativement aux lev\u00e9s p\u00e9dologiques g\u00e9n\u00e9ralis\u00e9s (1/100 000, soit un aper\u00e7u \u00e0 l'\u00e9chelle provinciale), de reconnaissance ou g\u00e9n\u00e9raux (1/125 000 ou un demi-pouce au mille). Les donn\u00e9es des lev\u00e9s p\u00e9dologiques d\u00e9taill\u00e9s sont beaucoup plus exactes et fiables pour la prise de d\u00e9cisions au niveau de la ferme. \r\n\r\nDes lev\u00e9s p\u00e9dologiques ont \u00e9t\u00e9 publi\u00e9s pour la plupart des r\u00e9gions agricoles et de nombreuses r\u00e9gions avoisinantes \u00e0 l'\u00e9chelle du Canada. ", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-132, 36], [-132, 90], [-52, 90], [-52, 36]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.agr.gc.ca", "type": "dataset", "resources": [{"resource_group_id": "3982d219-03dc-49d7-9dbe-446370c70449", "cache_last_updated": null, "revision_timestamp": "2013-06-14T18:03:03.116656", "webstore_last_updated": null, "id": "b9da88af-d1cf-45d5-a826-87385ffd00a2", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN", "created": "2013-06-14T14:03:03.298020", "url": "http://www.agr.gc.ca/atlas/data_donnees/geo/detailedSoilSurvey/en/fgdb/", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "9bc8c36a-1691-400f-8830-ef8eb8b2accc", "resource_type": "file"}, {"resource_group_id": "3982d219-03dc-49d7-9dbe-446370c70449", "cache_last_updated": null, "revision_timestamp": "2013-06-14T18:03:43.698933", "webstore_last_updated": null, "id": "db9cc15c-e479-422c-89b9-8aa728c5333e", "size": null, "state": "active", "hash": "", "description": "", "format": "fgdb / gdb", "tracking_summary": {"total": 0, "recent": 0