atlas/supportdocument_documentdesupport/detailedSoilSurvey/iMap_slc2.gif", "num_resources": 4, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Geoscientific Information  Information g\u00e9oscientifique", "Utilities Communication  Services communication", "Intelligence Military  Renseignements militaires"], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Agriculture  Agriculture", "name": "Agriculture  Agriculture", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "6d82a7f3-c145-4795-aa97-af8044a0c05c"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Atlantic  Atlantique", "name": "Atlantic  Atlantique", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "c7ec122f-14b7-4447-aaeb-53def03d58c6"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "British Columbia  Colombie-Britannique", "name": "British Columbia  Colombie-Britannique", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "e756881c-4781-4f15-b03b-1bc0f6688665"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Geoscientific Information  Information g\u00e9oscientifique", "name": "Geoscientific Information  Information g\u00e9oscientifique", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "8c16c727-a34e-4b2c-bfb9-621fd863fb83"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Intelligence Military  Renseignements militaires", "name": "Intelligence Military  Renseignements militaires", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "577d23a3-ea5b-477c-9065-276e13a125f4"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Ontario  Ontario", "name": "Ontario  Ontario", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "170ff7c8-314d-4801-853c-97c87b308aa9"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Prairies  Prairies", "name": "Prairies  Prairies", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "2abf6ecf-d565-494b-a57a-a50a86c3b80b"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Quebec  Qu\u00e9bec", "name": "Quebec  Qu\u00e9bec", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "db38a71d-cc91-40b2-b3de-a893f2fc46be"}, {"vocabulary_id": "02cbe753-2581-46db-a763-81e42056fe79", "display_name": "Territories  Territoires", "name": "Territories  Territoires", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "c6c59b71-ac42-4d28-a607-4a87aba661c7"}, {"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Utilities Communication  Services communication", "name": "Utilities Communication  Services communication", "revision_timestamp": "2013-06-14T17:38:03.377865", "state": "active", "id": "93de460b-d1d5-4f7f-bdf8-cbd1c58d592a"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-06-14 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "sciences de la Terre, agriculture, classification des sols, sol, \u00e9cosyst\u00e8me terrestre, zone humide", "groups": [], "organization": {"description": "", "title": "Agriculture and Agri-Food Canada | Agriculture et Agroalimentaire Canada", "created": "2013-05-14T09:17:34.038756", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:33.962743", "is_organization": true, "state": "active", "image_url": "", "revision_id": "7f3393e0-fe5e-4817-9aff-b35c2652a593", "type": "organization", "id": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "name": "aafc-aac"}, "data_series_name": "", "relationships_as_subject": [], "name": "7ed13bbe-fbac-417c-a942-ea2b3add1748", "revision_timestamp": "2013-06-14T18:05:21.493071", "metadata_modified": "2013-06-14T18:05:21.493071", "isopen": false, "date_modified": "2010-12-31 00:00:00", "url": "http://www.agr.gc.ca", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "2ABCCA59-6C57-4886-99E7-85EC6C719218", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Detailed Soil Surveys", "revision_id": "b5bab92a-ae14-4f6a-9af4-c910fdcf6c10", "notes": "A soil survey is an inventory of soils and their spatial distribution over a landscape.  Soil survey reports contain two parts. The first part is a soil map or series of maps at a particular scale with coding for each soil. Soil survey reports also include a supporting document that contains background information such as how the soil survey was conducted, and an explanation of interpretive criteria and a summary of the area occupied by various soil types. \r\n\r\nThe detailed soil surveys identify more of the variation in soil types across smaller landscapes, as compared to Generalized (1:100 000, i.e. provincial overview) and Reconnaissance or General (1:125 000, or 1/2 inch to 1 mile.) soil surveys.  Detailed soil survey information is much more accurate and reliable for making decisions at the farm-level. \r\n\r\nSoil surveys have been published for most of the agricultural areas, and many surrounding areas, across Canada. Data from these surveys comprise the most detailed soil inventory information in the National Soil Database (NSDB).\r\nVersion 3 was created by Agriculture and Agri-Food Canada in the 2010's by amalgamating version 2 data. It introduced some minor refinements to the version 2 data structure to provide closer alignment with the Soil Landscapes of Canada data structure.\r\n", "department_number": 235}
