{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 1, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Notices of Compliance Brand", "keywords": "notice of compliance listings, notices of compliance with conditions", "data_series_issue_identification": "", "id": "f5094aec-376b-495a-9fcc-424024e276fc", "metadata_created": "2013-05-14T13:56:37.732665", "subject": ["Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9"], "data_series_name_fra": "", "spatial_representation_type": "", "maintenance_and_update_frequency": "Unknown | Inconnu", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Un avis de conformit\u00e9 (AC) est une notification d\u00e9livr\u00e9e en vertu du paragraphe C.08.004(1)(a), indiquant que le fabricant/promoteur se conforme aux articles C.08.002 ou C.08.003 et C.08.005.1 du R\u00e8glement sur les aliments et drogues. Un avis de conformit\u00e9 est \u00e9mis si la pr\u00e9sentation est jug\u00e9e conforme apr\u00e8s un examen complet.\r\nLes fichiers contenus dans l'extrait des donn\u00e9es d'avis de conformit\u00e9 contiennent les dates d'autorisation pour tous les m\u00e9dicaments pour lesquels un AC a \u00e9t\u00e9 \u00e9mis depuis 1994. Il y a quatre types d'AC : biologique, vente libre, vente sous ordonnance et v\u00e9t\u00e9rinaire. Ce fichier de donn\u00e9es contient des renseignements sur les avis de conformit\u00e9 brand.\r\n", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "", "spatial": "", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "type": "dataset", "resources": [{"resource_group_id": "9e8813ed-140d-4c3c-816f-a7a5a00e1f4c", "cache_last_updated": null, "revision_timestamp": "2013-05-14T21:09:07.928325", "webstore_last_updated": null, "id": "8e386fc7-6fb1-488c-885f-3ec8bc3911ca", "size": null, "state": "active", "hash": "", "description": "", "format": "other", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "Dataset", "mimetype": null, "cache_url": null, "name_fra": "Ensemble de donn\u00e9es", "language": "eng; CAN | fra; CAN", "created": "2013-05-14T17:09:07.996226", "url": "http://www.hc-sc.gc.ca/dhp-mps/alt_formats/txt/prodpharma/notices-avis/noc-acc/noc_brand.txt", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "67d43039-0602-4b4a-b1a8-4408971b6e82", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": [], "tags": [{"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "name": "Health and Safety  Sant\u00e9 et s\u00e9curit\u00e9", "revision_timestamp": "2013-05-14T13:56:37.732665", "state": "active", "id": "d6525956-d45a-41d8-bdeb-1a6c4a0c9a5f"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2010-08-19 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "liste des avis de conformit\u00e9, listes des avis de conformit\u00e9, ac, avis de conformit\u00e9 avec conditions,", "groups": [], "license_id": "ca-ogl-lgo", "data_series_name": "", "relationships_as_subject": [], "name": "f5094aec-376b-495a-9fcc-424024e276fc", "revision_timestamp": "2013-05-16T17:30:08.466255", "organization": {"description": "", "title": "Health Canada | Sant\u00e9 Canada", "created": "2013-05-14T09:17:51.376994", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:51.333174", "is_organization": true, "state": "active", "image_url": "", "revision_id": "94e225c6-b021-43c0-a7df-9beb7a7c1dae", "type": "organization", "id": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "name": "hc-sc"}, "metadata_modified": "2013-05-16T17:30:08.466255", "isopen": false, "url": "", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "BD26DB5E-82D2-42C1-99BB-08FCF6068FEE", "url_fra": "", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Notice of Compliance Brand", "revision_id": "f82eaa5c-1a19-4153-885d-1646f060aa13", "notes": "A Notice of Compliance is a notification, issued pursuant to paragraph C.08.004(1)(a), indicating that a manufacturer has complied with sections C.08.002 or C.08.003 and C.08.005.1 of the Food and Drug Regulations. Notices of Compliance are issued to a manufacturer following the satisfactory review of a submission.\r\n\r\nThe NOC extract files contain Health Canada authorization dates for all drugs dating back to 1994 that have received an NOC.  There are four types of NOCs: Biological, Prescription, Nonprescription and Veterinary.  This data extract contains information on Notice of Compliance Brand.\r\n", "department_number": 271}
