{"license_title_fra": "Licence du gouvernement ouvert - Canada", "maintainer": null, "relationships_as_object": [], "private": false, "maintainer_email": null, "num_tags": 2, "data_series_issue_identification_fra": "", "catalog_type": "Data | Donn\u00e9es", "license_title": "Open Government Licence - Canada", "title_fra": "Satellite", "keywords": "Satellite, OMI, NO2, SO2, Remote sensing, Images, oil sands", "data_series_issue_identification": "", "ready_to_publish": true, "id": "1d36eeb0-b51b-489b-b149-70947988a855", "metadata_created": "2013-06-13T17:22:52.281723", "subject": ["Nature and Environment  Nature et environnement"], "data_series_name_fra": "", "spatial_representation_type": "Vector | Vecteur", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": null, "author_email": "open-ouvert@tbs-sct.gc.ca", "geographic_region": [], "notes_fra": "Les donn\u00e9es satellitaires ont \u00e9t\u00e9 utilis\u00e9es pour produire des images et des fichiers de donn\u00e9es g\u00e9or\u00e9f\u00e9renc\u00e9es sur la \u00ab densit\u00e9 de la colonne verticale \u00bb (ce qui correspond \u00e0 la concentration \u00e0 la surface) de dioxyde d'azote (NO2) et de dioxyde de soufre (SO2). Il s'agit de gaz produits \u00e0 partir de plusieurs sources naturelles et anthropiques qui contribuent \u00e0 la formation du smog et des pluies acides. Ces donn\u00e9es satellitaires pr\u00e9sentent une r\u00e9solution spatiale relativement \u00e9lev\u00e9e (taille approximative de l'empreinte : 13 km x 30 km) qui s'\u00e9tend sur une zone d'int\u00e9r\u00eat circulaire de 600 km de diam\u00e8tre au-dessus de la r\u00e9gion des sables bitumineux. Des cartes haute d\u00e9finition des moyennes de NO2 ont \u00e9t\u00e9 cr\u00e9\u00e9es \u00e0 l'aide des nouvelles techniques d'analyse \u00e9labor\u00e9es par Environnement Canada. R\u00e9f\u00e9rence : McLinden, C. A., V. Fioletov, K. F. Boersma, N. E. Krotkov, C. Sioris, J. P. Veefkind, et K. Yang (2012), Air quality over the Canadian oil sands: A first assessment using satellite observations, Geophys. Res. Lett., 39, L04804, doi:10.1029/2011GL050273.", "digital_object_identifier": "", "state": "active", "version": null, "presentation_form": "Table Digital | Table num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-116.00000,59.00000], [-108.00000,59.00000], [-108.00000,55.00000], [-116.00000,55.00000],[-116.00000,59.00000]]]}", "license_id": "ca-ogl-lgo", "url_fra": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=fr", "type": "dataset", "resources": [{"resource_group_id": "a82d302c-53c3-4977-960b-35515aef814b", "cache_last_updated": null, "revision_timestamp": "2013-06-13T17:28:50.245106", "webstore_last_updated": null, "id": "7ad3333a-cd4b-4195-9bf3-2d9505fc1ba7", "size": null, "state": "active", "hash": "", "description": "", "format": "XLS", "tracking_summary": {"total": 0, "recent": 0}, "mimetype_inner": null, "name": "OSM Air Quality Data", "mimetype": null, "cache_url": null, "name_fra": "Donn\u00e9es sur la qualit\u00e9 atmosph\u00e9rique de l\u2019OSM", "language": "eng; CAN | fra; CAN", "created": "2013-06-13T13:24:27.656332", "url": "http://www.ec.gc.ca/data_donnees/SSB-OSM_Air/Satellite", "webstore_url": null, "last_modified": null, "position": 0, "revision_id": "79c9ef0a-74bf-4f17-b36b-7d082d427d18", "resource_type": "file"}], "browse_graphic_url": "", "num_resources": 1, "attribution": "Contains information licensed under the Open Government Licence \u2013 Canada.", "topic_category": ["Environment  Environnement"], "tags": [{"vocabulary_id": "ef028439-f5b1-47b8-9171-0fd727d7c0ee", "display_name": "Environment  Environnement", "name": "Environment  Environnement", "revision_timestamp": "2013-06-13T17:22:52.281723", "state": "active", "id": "6ababc3d-d1be-4402-b3c6-ccad2a36711c"}, {"vocabulary_id": "fccae7c0-b632-4352-a811-e9d724dd4996", "display_name": "Nature and Environment  Nature et environnement", "name": "Nature and Environment  Nature et environnement", "revision_timestamp": "2013-06-13T17:22:52.281723", "state": "active", "id": "86bb7065-9569-4281-a2c9-95d1f91cf1e8"}], "attribution_fra": "Contient des informations autoris\u00e9es sous la Licence du gouvernement ouvert- Canada", "endpoint_url_fra": "", "date_published": "2013-01-18 00:00:00", "tracking_summary": {"total": 0, "recent": 0}, "keywords_fra": "Satellite, OMI, NO2, SO2, t\u00e9l\u00e9d\u00e9tection, images, sables bitumineux", "groups": [], "organization": {"description": "", "title": "Environment Canada | Environnement Canada", "created": "2013-05-14T09:17:41.395797", "approval_status": "approved", "revision_timestamp": "2013-05-14T13:17:41.354936", "is_organization": true, "state": "active", "image_url": "", "revision_id": "18112ac5-2ef2-4519-ad05-a58dc9985d41", "type": "organization", "id": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "name": "ec"}, "data_series_name": "", "relationships_as_subject": [], "name": "1d36eeb0-b51b-489b-b149-70947988a855", "revision_timestamp": "2013-06-13T17:27:49.076866", "metadata_modified": "2013-06-13T18:05:21.763959", "isopen": false, "url": "http://www.jointoilsandsmonitoring.ca/pages/home.aspx?lang=en", "language": "eng; CAN | fra; CAN", "endpoint_url": "", "owner_org": "49E2ADF4-AD7A-43EB-85C8-6433D37ED62C", "license_url": "http://www.data.gc.ca/default.asp?lang=En&n=E7BD8C3D-1", "license_url_fra": "http://www.data.gc.ca/default.asp?lang=Fr&n=E7BD8C3D-1", "title": "Satellite", "revision_id": "2375b2f0-a400-4d63-9343-2df42c89d1b8", "notes": "Satellite overpass data have been used to produce images and geo-referenced data files of nitrogen dioxide (NO2) and sulphur dioxide (SO2) \u201cvertical column density\u201d (which correlates with surface concentration).  These are gases that have several natural and man-made sources and contribute to smog and acid rain.  These satellite data are at a relatively high spatial resolution (footprint size of approximately 13 km x 30 km) spanning a circular area of interest of 600km diameter over the Oil Sands region.  Using new analysis techniques developed at Environment Canada, high-resolution average maps of NO2 have been created. Reference: McLinden, C. A., V. Fioletov,K. F. Boersma, N. Krotkov, C. E. Sioris, J. P. Veefkind, and K. Yang (2012), Air quality over the Canadian oil sands: A first assessment using satellite observations, Geophys. Res. Lett., 39, L04804, doi:10.1029/2011GL050273", "department_number": 99}
